('83e3e4dc5d788df29c0cddcf8ebfbe99c88d7fe9', '2009-01-21 11:44:20', 'a8151b61aa876a5bd668ca6f7283c847bc6d7f61', 1);
INSERT INTO `clanok` (`clanok_id`, `main_section_id`, `nazov`, `short_text`, `big_text`, `section_id`, `datetime`, `user`, `comments`, `image`, `home`, `counter`) VALUES
(1, 30, 'Trip do Radole', 'Trip do Radole.\r\n(Text nie je vhodny pre deti ak sa nachadzaju v miestnosti vykazte ich prec..dakujem za pochopenie)\r\nPomocou napomenutia ma napadlo vytvorit tento clanok ohladom nasho tripu alebo po slovensky vyletu do SkateParku v Radoli.', 'Trip do Radole.\r\n(Text nie je vhodny pre deti ak sa nachadzaju v miestnosti vykazte ich prec..dakujem za pochopenie)\r\nPomocou napomenutia ma napadlo vytvorit tento clanok ohladom nasho tripu alebo po slovensky vyletu do SkateParku v Radoli.\r\n\r\n\r\nPrakticky si ani nepamatam ako to bolo lebo to bolo abnormalne davno, s urcitostou som tam bol ja osobne len jeden krat. Takze zacalo to tym ze som si asi tak 3 dni pred tym tripom aj ked som o nom este nevedel zlomil patku na prehadzovacku …co som mal na svojom byvalom bajku Gt Chucker 2.0 model 2006…teraz sa uspokojujem na caprnke ej.kej.ej ram made in slovakia.  ….ale spat k tripu…v ten den ako som si zlomil patku tak mi rider pastwos oznamil ze sa uracime ist do radole jazdit do miestneho skate parku….ja som sa skoro rozplakal ked som sa to dozvedel s faktom tym ze mam urvanu patku….a fucking cami sport mi ju nezreklamuje tak davaj Typek zhanaj patku v hodnote 500 sk od roznych bike shopov tuna v Čadci. V dany den ked sme mali ist bol posledny dne kedy som si ju mal zohnat ….keby som si ju nezohnal tak by samozrejme asi nasledovala samovrazda s podani zapalenia sa po obliati neakeho paliva..a tak som stastny sa vratil domov s patkou…cely stastny si montujem az ku mne dojdu neaki traja chalosi s doskami v paprciach. Sociatku som si myslel kvoli ich poctu, ze je to verejne napadnutie miestneho obyvatelstva s prirodnymi materialmi ale chvalabohu som sa zmylil. V tom som videl oslnenie bieleho ramu…no samozrejme ze to bol Mr.Pastwo s jeho krasnou pichajdejdou Norikou s vyrobnym cislom 125. Po nastelovani patky hura do radole. Nastupili sme do vlaciku vsetci rideri a sk8taci. \r\n\r\nStooop Kysucke nove Mesto…veget vyjdeme z vlaku a pastwo s kamaratom sa oddialili na chvilku a tak chalani zacali hrotit na miestnych betonovych prekazkach v tom dosla miestna starsia vetcha pani pokladnicka pouzivajuca vulgarne slova citujuc: „ pana boha vasho palte odtialto do xyz inak na vas zavolam žandarov“ –koniec citatu. Po mojom osobnom vysmechu sme sa odialili vykrikujuc poburujuce extremisticke hesla po vetchej pani upratovacke typu:skate and bike is not a crime-no niesme my ale hulvati ?…samozrejme pani nahodila mimiku somalskeho domorodca prvy krat vidaci label coca cola . Ako si tak sypeme tak hladame bajnu cestu k danemu cielu Radoľa. Samozrejme ja s pastwom sme este hladali isty bike shop pre nitovacku ktory ma on osobne moc rad a po navsteve aj ja lebo ked sme odchadzali boli sme obaja spokojny lebo sme mali co sme chceli a este k tomu sme satiricky davali najavo svoje nazory na cadciansky cami sport….obaja sme sa zhodli. Po nahodeni retaze sme si spolu hladali prekazky pocas cesty do radole…az som nasiel take povedzme „ betonove mini transfery“ ktore som opisal pastwovi a on s vykulenymi ocami ich siel zdolat. \r\n\r\nTak sme si ich nasli a zacali po nich jazdit ako pastwo siel prvy tak preletel cely transfer a ja v uzase pozeram az zrazu pocujem z dialky smerujucej od neho velke hlasne:“Chrup“…po istom casovom useku az do ciela k danemu skate parku som sa nezmohol na nic ine len razantne v castych intervaloch vyjadrenie:“ty kokos“. Zjavne to pastwosovi nicilo naladu a ja som sa si to ani neuvedomoval od uzasu…a tak pastwo mohol pomalicky zabalit svoj bajk s pedalmi na ktore ked ste sa postavili pripadali ako klokanie chodidla. Lenze rider Typek je velky solidarista a neznalec gramatiky pouzivanej v tomto prispevku tak sem tam poziciel mu svoj bajk  (pijem bacardi).Skate park sa skladal z dvoch bankov a jedneho povedzme kickera aj s dopadom a railom- na kysucke podmienky hotovy raj. Chalani zacali jazdit a pekne ukazovali a cvicili svoje skillz mohli sme vidiet pekne airy a chalani na skatovych doskach robili krasne flipy grapi a raily….lenze po istej chvili sa strhol lejak a cely park z plechu bol mokry tak sme si museli pockat. Zabudol som dodat ze uz pocas cesty vlakom prsalo.po krasneh chvili rajdovania a spolocneho spolunazivania extremnych sporvtov sme sa museli pobrat spat do nasich pribytkov vzdialenych pekne daleko od Skate parku. \r\n\r\nPocas cesty spat nam taktiez krasne prsalo..ale to nebranilo pastvosovi skusat stabilitu svojich pneumatik na svojom bajku pocas dazda na klzkej cesty v akrobatickych polohach velmi blizko oproti iducim nakladnym autom znacky TATRA. Po radostom zvolani:“pastvos ty….xyz…“ sme sa vsetci usmiali a odisli do svojich pribytkov. V Kysuckom Novom Meste sme sa rozlucili a sli kazdy svojou maznostou transportu domov. Mozem s kludnym svedomim Cadcianskeho kriminalnika a hovada skonstatovat ze to bol jeden krasny vydareny den a trip a s naprostou urcitostou si to nie len ja zopakujem znovu. Dakujem Vam za citanie tohto dlheho nudneho uprsaneho katastrofickeho satiristickeho urazajuceho vycerpatelneho pre vas asi zbytocne okradajuci o cas divneho prispevku a dufam ze sa stretneme pri jadze na svojich masinkach. \r\n\r\nPOZOR TENTO TEXT OBSAHUJE TOTALNU GRAMATICKU NEPRISPOSOBILOST DAKUJEM ZA POCHOPENIE.\r\n\r\nAutor: Typek', 0, '2008-03-29 18:55:53', 'typek', 1, , 0, 62);
INSERT INTO `clanok` (`clanok_id`, `main_section_id`, `nazov`, `short_text`, `big_text`, `section_id`, `datetime`, `user`, `comments`, `image`, `home`, `counter`) VALUES
(2, 30, 'Bikepark Bad Wildbad', 'Bikepark sa nachádza v strede nemeckého schvartzwaldu pri kúpeľnom meste Wildbad do parku sa dostanete smerom na centrum a potom už le sledovať tabule Bikepark alebo Sommerberg. Po dorazení na parkovisko si nachystajte tri eurové mince na zaplatenie parkovného, tie vám vrátia pri zakúpení lístka, po predložení útržku (to platí na celý deň). ', 'Bikepark sa nachádza v strede nemeckého schvartzwaldu pri kúpeľnom meste Wildbad do parku sa dostanete smerom na centrum a potom už le sledovať tabule Bikepark alebo Sommerberg. Po dorazení na parkovisko si nachystajte tri eurové mince na zaplatenie parkovného, tie vám vrátia pri zakúpení lístka, po predložení útržku (to platí na celý deň). \r\n\r\n\r\nManažérom parku je Markus Klausman jedenásť násobný majster nemecka v zjazde. Kúsok od parkoviska je shop v ktorom je možné zakúpiť všetko po čom duša bajkera túži. Je v ňom aj požičovňa chráničov a bicyklov SOLID, sú tu aj husté mašiny, odporúčam zarezervovať vopred telefonicky(<a href="http://www.bikers-paradise.org/">www.bikers-paradise.org</a>). \r\n\r\nTak isto si tam kúpte lístok buď na horskú železnicu a vlek, to v prípade že chcete jazdiť aj downhilové a freerajdové trate alebo len na vlek ak chcete jazdiť len 4X,2X, northshore a dirt. Celkovo je tam šesť tratí dva downhilly, jeden IXS Cup strednej európy a ostané sú staršie, potom dva freefrajdy jeden sponzorovaný Kärcherom a druhý postavili ludia z parku. Ďalej už spomínaný 4X a dual, ktorý sa napája v spodnej časti na 4X. Hore sa nachádza northshore sponzorovaný MAGUROU, je tam pár lavičiek, neké dropíky a nakoniec malý dirt úple hore pri chate tak na zahriatie. Pokiaľ potrebujete pomoc neni problém ľudia aj bajkri sú ochotný. Chlapík v shope vie po nemecky, anglicky a francúzky takže rečový problém by nemal biť. Ja osobne tu jazdím iba ten 4X a trocha dual. To z dôvodu, že miestna trať je celkom rýchla a netreba moc tlačiť do pedálov niečo okolo 700 metrov dlhá 80 metrov výškových. Ďalším dôvodom ja celková rozmanitosť, kde vrch je dosť rýchli s menšími skokmi a rýchlo striedajucími sa zákrutami a potom sú tri celkom slušivé skoky na prvom z nich je možnosť výberu medzi rýchlosťou a airtime. Tie nasledujúce buď dáte alebo nie?! Potom par malinkých skokov na skľudnenie a hybaj zas hore. \r\n\r\nText: Ďuro', 0, '2008-03-29 20:47:20', 'ďuri', 1, , 0, 22);
INSERT INTO `clanok` (`clanok_id`, `main_section_id`, `nazov`, `short_text`, `big_text`, `section_id`, `datetime`, `user`, `comments`, `image`, `home`, `counter`) VALUES
(3, 31, 'Biograd - Chorvátsko', 'More, kamenisté pláže, morskí ježkovia vo vode a kvantá od slnka spálených čechov a slovákov. Niektorí už tušia, že sa nachádzame v Chorvátsku, konkrétne v meste Biograd na Moru. ', 'More, kamenisté pláže, morskí ježkovia vo vode a kvantá od slnka spálených čechov a slovákov. Niektorí už tušia, že sa nachádzame v Chorvátsku, konkrétne v meste Biograd na Moru. \r\n\r\n\r\n\r\nV čase ukrutných horúčav tu trávime pracovný týžďeň, no na šťastie sme si našli aj čas porozhľiadnuť sa po okolí. Nemali sme síce svoje biky k dispozícii, no slúžobné HC biky /hard-core/ nám tiež poslúžili. V podvečer jedného dňa sme vytiahli naše služobné kostitrasi avyzbrojení mapkou, ktorú tu zoženiete skoro všade zadarmo,  vydali sme sa smerom na juh. Cieľ sme mali stanovený a už nás nič nedelilo od cyklistického dobrodružstva v Chorvátsku. \r\n\r\nZ Biogradu sme sa viezli pár metrov po asfalte, no čoskoro sme sa dostali k cyklistickej značke, ktorá nás smerovala na juh. Musím podotknúť že je tu veľmi dobré značenie, aspoň v oblasti Biogradu. Po kamenisto štrkovej ceste nás čalaki 2 mierné prevýšenia, aby sme sa dostali na tzv. fotopoint z ktorého bol veľmi dobrý výhľad na okolité strediská, more, ostrovy a náš cieľ Vranské jazero. Neodpustili sme si zopár ilustračných záberov a pokračovali sme v ceste. Miernym klesaním sme sa zviezli do Pakoštane a od tiaľ po značkách k Vranskému jazeru. \r\n\r\nJe to vlastne prírodná rezervácia, no na niektorých miestach sa dá kúpať bez problémov. Na brehoch jazera sa nachádzajú aj rôzne kempy s možnosťou ubytovania, reštaurácie, alebo voľne prístupné pláže. My sme pre svoju návštevu zvolili pláž, kde  sme natrafili iba na miestne živočíšstvo a domorodcov, ktorí sa chceli očividne okúpať na adama, no keď nás zazreli, rozhodli sa pre taktický manéver a ustúpili do úzaďia. Neviem prečo no očividne sme ich prekvapili:-) \r\n\r\nKeďže sa už začalo ztmievať, otestovali sme teplotu vody a vydali sme sa na spiatočnú cestu. Táto trasa je vhodná naozaj prekaždého. Rekreačným tempom v šlapkách sme na kostitrasoch sme ju zvládli asi za 45 minút. Samozrejme okolo celého jazera sú značené cylkistické chodníky a je na každom, či sa rozhodne pre okružnú jazdu popri jazere, alebo sa vydá iným smerom.', 0, '2008-03-29 21:14:26', 'štrkáč', 1, , 0, 7);
INSERT INTO `clanok` (`clanok_id`, `main_section_id`, `nazov`, `short_text`, `big_text`, `section_id`, `datetime`, `user`, `comments`, `image`, `home`, `counter`) VALUES
(4, 30, 'Biketrip na Mosty u Jablunkova', 'Rozlepím oči, a vstanem v nádeji, že dážď čo celú noc padal na strechu už prestal a nezanechal po sebe rozbahnené cesty. Idem k oknu skontrolovať situáciu. Vidím zopár kaluží a zisťujem, že vonku nie je až taká zima. Z toho všetkého usudzujem, že výlet môže byť ešte vydarený. V rýchlosti beriem potrebné veci do ruksaku, obliekam chrániče a dres.', 'Rozlepím oči, a vstanem v nádeji, že dážď čo celú noc padal na strechu už prestal a nezanechal po sebe rozbahnené cesty. Idem k oknu skontrolovať situáciu. Vidím zopár kaluží a zisťujem, že vonku nie je až taká zima. Z toho všetkého usudzujem, že výlet môže byť ešte vydarený. V rýchlosti beriem potrebné veci do ruksaku, obliekam chrániče a dres.\r\n\r\n    Neteší ma že musím šlapať v plnej zbroji asi 12 km s plášťami do blata so šírkou 2.5. Ale čo sa dá robiť, keď si chce človek poriadne zajazdiť. O 7:30 nasadáme spoločne s Paulou na naše biky a vyrážame smer Čadca - miesto stretnutia. Zraz sme mali o 08:30 pred kultúrnym domom, no chcel som tam byť skôr, pretože sme mali s Pastwošom ešte nahadzovať prednú brzdu.V obavách že ostatní jazdci dali prednosť vyhriatej posteli prichádzame na miesto stretnutia. No našťastie sa na nás už z diaľky usmievali Pastwoš a Týpek. Asi o 2 minúty na to dorazil aj Tomáš a po menších technických úpravách a kontrole bikov sme sa vydali na cestu. Ešte som prezvonil Vladovi, aby vedel že sme šli. Sľúbil že v priebehu dňa príde pozrieť aj on.\r\n\r\n    Asi po hodine urputného šliapania cez Milošovú a Šance sme dorazili na Mosty u Jablunkova do Bikeparku. Hneď z dola som videl novú prekážku, ktorá tam ešte nebola, keď som bol zmapovať situáciu  asi pred 2 týždňami. S rešpektom sme pozreli na wallride, ktorý sa týčil do výšky asi 3 metrov. Pokračovali sme po kopci smerom hore a došli sme na lúku plnú rôznych lavíc, húpačiek, dropov a skokov. Veru, taký park v okolí človek nikde nenájde. Počiatočný rešpekt pred mohutnosťou prekážok a občasné mrholenie nás vyhnali na začiatok trate. Sú tam 2 hlinené skoky 2 maličké klopenky a 1 drop, z ktorého sa skáče na veľkú lávku. Ďalej sme už nepokračovali, pretože drevo a aj hlinený podklad celkom šmýkali. Na vlastnej koži sme sa postupne o tom presvedčili všetci, no na šťastie bez vážnejších zranení a materiálnych škôd.\r\n\r\n    Trénovali sme teda techniku skoku na začiatku trate, robili nejaké fotky a užívali si jazdy. Po čase sa aj počasie umúdrilo a drevené prekážky z časti oschli. Neodolali sme teda  a šli sme posúvať hranice strachu na spomínanú lúku. Tiež svojou prítomnosťou spestril náš pobyt v parku aj Vlado.\r\n\r\n    Ako prvé sa nám zdalo najrozumnejšie otestovať klzkosť dreva na malej húpačke. Po menších úvahách sme sa na nej zhúpli všetci a lákala nás ďalšia výzva. Jej staršia sestra. Bola o čosi väčšia, teda mali sme pred ňou väčší rešpekt. No po skúškach na boso, teda bez biku sme sa pustili aj do nej a nijak sme ju nešetrili. Keď nás prestala aj táto atrakcia baviť, šli sme pokoriť novo postavený wallride. Ten svojou mohutnosťou pôsobil najprv ako nezjazdný, no po čase aj on okúsil hrúbku našich dezénov. Pre tých čo v živote nejazdili na wallride to je veľký zážitok. Nie každý deň človek jazdí v 90 stupňovom záklone k zemi. \r\n\r\n    V ten deň nás lákali aj iné atrakcie, no počasie hovorilo stop, vždy keď sme sa chceli odhodlať na niečo nové. Asi okolo 16:00 sme šli doplniť tekutiny za prijateľné ceny do miestneho bufetu, ktorý sa nachádza za hotelom na detskom ihrisku.\r\n\r\n    Po občerstvení berieme biky a znova po ceste cez Šance a Milošovú sa vraciame do Čadce. Pre tých ktorí nebudú mať adrenalínu dosť, sú pripravené rôzne atrakcie v areáli. Bližšie info na  <a href="http://www.skimosty.cz/" target="blank"><b>http://www.skimosty.cz/</b></a>. \r\n\r\n    Touto cestou chcem poďakovať všetkým zúčastneným za podporu klubovej akcie a ochotu pomáhať. Tento článok tiež môže byť motivácia aj pre vás, aby ste nasadli na biky, zobrali prilby a neváhali sa vydať za dobrým pojazdením aj za hranice. <i>/ 12 km nie je až tak ďaleko!!!/</i>\r\n\r\n\r\n<i>autor: </i><b>Štrkáč ( Down Hill Čadca )</b>', 1, '2008-03-29 21:23:31', 'pastwo', 1, , 0, 24);
INSERT INTO `clanok` (`clanok_id`, `main_section_id`, `nazov`, `short_text`, `big_text`, `section_id`, `datetime`, `user`, `comments`, `image`, `home`, `counter`) VALUES
(5, 32, 'Vyjadrenie klubu', '<p align="center"><strong>V poslednej dobe som si všimol na internete rôzne diskusie týkajúce sa klubu Down Hill Čadca. <br />Zaoberajú sa stavbou tratí v Čadci a okolí a vyobrazujú cyklistov, ktorí sa prezentujú ako členovia klubu Down Hill Čadca, avšak títo borci si neuvedomujú rozdiel medzi registráciou v klube a registráciou na diskusnom fóre. <br />Tiež spájajú svoje aktivity s aktivitami cyklistického klubu Down Hill Čadca.<br />Náš klub sa dištancuje od všetkých nelegálnych aktivít a stavieb nachádzajúcich sa v Čadci a okolí. <br />Spoločným menovateľom autorov týchto diskusií je chabá gramatika.<br />Ďakujem za pochopenie!</strong></p>\r\n\r\npredseda klubu DHCA\r\nMilan Chrt', '<p align="center"><strong>V poslednej dobe som si všimol na internete rôzne diskusie týkajúce sa klubu Down Hill Čadca. <br />Zaoberajú sa stavbou tratí v Čadci a okolí a vyobrazujú cyklistov, ktorí sa prezentujú ako členovia klubu Down Hill Čadca, avšak títo borci si neuvedomujú rozdiel medzi registráciou v klube a registráciou na diskusnom fóre. <br />Tiež spájajú svoje aktivity s aktivitami cyklistického klubu Down Hill Čadca.<br />Náš klub sa dištancuje od všetkých nelegálnych aktivít a stavieb nachádzajúcich sa v Čadci a okolí. <br />Spoločným menovateľom autorov týchto diskusií je chabá gramatika.<br />Ďakujem za pochopenie!</strong></p>\r\n\r\npredseda klubu DHCA\r\nMilan Chrt', 0, '2008-12-28 21:29:55', 'štrkáč', 1, '', 0, 5);
INSERT INTO `clanok` (`clanok_id`, `main_section_id`, `nazov`, `short_text`, `big_text`, `section_id`, `datetime`, `user`, `comments`, `image`, `home`, `counter`) VALUES
(6, 32, 'O klube', 'Rozhodli sme sa založiť klub, lebo nás už nebavilo sa stále vyhovárať, že v Čadci nie sú podmienky na jazdenie, a nikto nemá možnosti športovať. Že tu nie je žiaden klub ani organizácia, ktorá by nezištne vybudovala niečo pre mladých a podporila by tak potenciálny rozvoj talentov...', 'Rozhodli sme sa založiť klub, lebo nás už nebavilo sa stále vyhovárať, že v Čadci nie sú podmienky na jazdenie, a nikto nemá možnosti športovať. Že tu nie je žiaden klub ani organizácia, ktorá by nezištne vybudovala niečo pre mladých a podporila by tak potenciálny rozvoj talentov.\r\n\r\n	\r\n    Toto a mnoho ďalších dôvodov nás viedlo k tomu, aby sme sa stretli, spísali dokumenty potrebné na registráciu a založili klub.\r\n\r\n    Hlavný faktor, ktorý nás ovplyvnil je vzťah k cyklistike ako takej.\r\n\r\n    Keďže sme v meste situovanom v peknej prírode ideálnej aj na turistiku, rozhodli sme sa že sa budeme snažiť rozvíjať aj toto odvetvie.\r\n\r\n    To či sa nám to bude dariť, záleží aj od vás, preto nebuďte pasívni a zapojte sa aj vy!!!\r\n\r\n<center>\r\nCyklistický klub <b>Down Hill Čadca</b> vznikol zápisom na Ministerstve vnútra SR dňom <b>04. 04. 2007</b>.\r\n</center>\r\n\r\n<center>\r\nČekni oficiálne stránky klubu:\r\n<a href="http://downhillaction.com" target="_blank"><b>http://downhillaction.com</b></a>\r\n\r\nČekni fórum klubu:\r\n<a href="http://downhillaction.com/forum" target="_blank"><b>http://downhillaction.com/forum</b></a>\r\n\r\n<img  border="0" alt="Chod na ficiálne fórum klubu." src="upimages/down-hill-cadca2.jpg" /></center>', 0, '2008-03-29 21:43:52', 'štrkáč', 1, , 0, 18);
INSERT INTO `clanok` (`clanok_id`, `main_section_id`, `nazov`, `short_text`, `big_text`, `section_id`, `datetime`, `user`, `comments`, `image`, `home`, `counter`) VALUES
(7, 32, 'Vitajte na stránke', '<center><img src="uploads/down-hill-cadca2.jpg" alt="dhca" />\r\n<b>Stránky venované nie len lokálnym jazdcom a turistom\r\n\r\nNa týchto stránkach môžete nájsť informácie o klube, uskutočnených a plánovaných akciách, fotoreporty, výsledky z pretekov a veľa ďalších užitočných informácií zo sveta cyklistiky a turistiky.\r\n\r\nSúčasťou našich stránok je aj aktívne fórum, kde môžete po registrácii prispievať svojimi názormi, nápadmi a radami.</b></center>', '<center><img src="uploads/down-hill-cadca2.jpg" alt="dhca" />\r\n<b>Stránky venované nie len lokálnym jazdcom a turistom\r\n\r\nNa týchto stránkach môžete nájsť informácie o klube, uskutočnených a plánovaných akciách, fotoreporty, výsledky z pretekov a veľa ďalších užitočných informácií zo sveta cyklistiky a turistiky.\r\n\r\nSúčasťou našich stránok je aj aktívne fórum, kde môžete po registrácii prispievať svojimi názormi, nápadmi a radami.</b></center>', 0, '2099-12-28 22:11:31', 'štrkáč', 1, , 1, 27);
INSERT INTO `clanok` (`clanok_id`, `main_section_id`, `nazov`, `short_text`, `big_text`, `section_id`, `datetime`, `user`, `comments`, `image`, `home`, `counter`) VALUES
(8, 31, 'Javorníky 1', '<b>1. Čadca Kyčerka – Husárik – Grečovci – Črchla – Chotárny kopec – Belajky – Ochodnica ( 11 Km ) </b>\r\nPekný turistický výlet pre celú rodinu, ale aj pre cykloturistov začíname v Čadci, na sídlisku Kýčerka, odkiaľ po červenej turistickej značke stúpame k renovovanému hotelu Husárik, kde by sme mali doraziť asi za trištvrte hodinu. ', '<b>1. Čadca Kyčerka – Husárik – Grečovci – Črchla – Chotárny kopec – Belajky – Ochodnica ( 11 Km ) </b>\r\nPekný turistický výlet pre celú rodinu, ale aj pre cykloturistov začíname v Čadci, na sídlisku Kýčerka, odkiaľ po červenej turistickej značke stúpame k renovovanému hotelu Husárik, kde by sme mali doraziť asi za trištvrte hodinu. \r\n\r\n\r\nNa šťastie po dlhoročnému chátraniu je hotel už v prevádze a poskytuje všetky služby, ktoré sa dajú od horského hotela očakávať.My však sledujeme stále červenú značku, aby sme sa po pätnástich minútach dostali do osady Grečovci, odkiaľ je veľmi pekný panoramatický výhľad na okolité Javorníky a malé osady na Zákopčí. Po ďalších štyridsiatich minútach sa cez osadu Burdovci dostaneme na Črchlu.\r\n\r\nTu sa môžeme chvíľu zastaviť a vychutnať si pohľad na Moravsko-Sliezske Beskydy na severozápade a Malú Fatru na juhovýchode. Z Črchle je už len kúsok na zalesnený Chotárny kopec (906 m.n.m.), ktorý je v lete rajom zberačov čučoriedok a nemenej preslulých magických hubyčiek. \r\n\r\nZ chotárneho kopca sa pustíme doľava už po zelenej turistickej značke a klesáme cez osadu Belajky až do Ochodnice, odkiaľ vidíme celú Kysuckú vrchovinu. V Ochodnici je niekoľko „občerstvovacích staníc“, kde môžeme príjemne posedieť a počkať na vlakový spoj do Čadce alebo do Žiliny. ', 2, '2009-01-28 23:01:00', 'štrkáč', 1, , 0, 30);
INSERT INTO `clanok` (`clanok_id`, `main_section_id`, `nazov`, `short_text`, `big_text`, `section_id`, `datetime`, `user`, `comments`, `image`, `home`, `counter`) VALUES
(13, 31, 'Kysucká vrchovina 1', '<b> 1.   Brodno – Rudinka – Rochovica(640m.n.m.) – Závršie (609m.n.m.) – Čambalovci – Rudinská Tarabovci – Pálenica (545m.n.m.) - Rudina  (11km)</b>\r\n<b>Kysucká brána:</b> Chránený prírodný útvar, Kysucká brána leží na južnom okraji Kysúc v mieste prielomu rieky Kysuce medzi obcami Rudinka, Vranie a Brodno. Spolu so štátnymi prírodnými rezerváciami Rochovicou a Brodniankou vytvára impozantný vstup do južnej časti Kysúc.', '<b> 1.   Brodno – Rudinka – Rochovica(640m.n.m.) – Závršie (609m.n.m.) – Čambalovci – Rudinská Tarabovci – Pálenica (545m.n.m.) - Rudina  (11km)</b>\r\n<b>Kysucká brána:</b> Chránený prírodný útvar, Kysucká brána leží na južnom okraji Kysúc v mieste prielomu rieky Kysuce medzi obcami Rudinka, Vranie a Brodno. Spolu so štátnymi prírodnými rezerváciami Rochovicou a Brodniankou vytvára impozantný vstup do južnej časti Kysúc.\r\n\r\nTak pootvorme spoločne túto bránu a nahliadnime do krásnej kysuckej prírody. \r\n\r\nNa dnešnej túre budeme trocha improvizovať, lebo dostať sa na krásnu Rochovicu nie je až také jednoduché, akoby sa na prvý pohľad zdalo. Výnimočne sa budeme držať hesla, že po turistických značkách chodí len amatér a zbabelec, zapojíme svoju intuíciu a zaklopeme na jeden z pilierov kysuckej brány.\r\n\r\nNajprv ale nasadneme v Čadci na osobný vlak smer Žilina (ideálny je ten o 7.34 hod.) a vystúpime na poslednej zastávke pred Žilinou – v Brodne. Zastávka je prakticky v strede medzi Brodniankou a Rochovicou. Musíte sa po železničnom moste kúsok vrátiť do Rudinky a pokochať sa pohľadom na trblietavú Kysucu, ako sa preplieta medzi týmito dvoma zelenými kopcami. V Rudinke si môžete pozrieť Rochovicu zo všetkých strán, ale len z úctivej vzdialenosti, lebo výstup na chránené vápencové bralo je v týchto miestach zhola nemožný. A tak vám nezostáva nič iného, než prejsť v Rudinke okolo futbalového ihriska a reštaurácie Rochovica a stočiť sa vľavo za dedinu. Asi po 500m sa dostanete na poľnú cestu, ktorá sa stáča hore do lesa. Po necelých dvoch kilometroch chôdze lesom sa napojíte na modrú turistickú značku, ktorá vedie od Budatína. Chvíľu pôjdete po značkách až sa dostanete na rázcestie. Tam modrú opäť opustíte a úzkym chodníčkom vľavo sa „vyšplháte“ na dnešný náš cieľ, na Rochovicu.\r\n\r\nAk čakáte krásny výhľad, budete sklamaní, bučiny vám to nedovolia. Kysuckú bránu a vrcholy s ňou susediace si lepšie vychutnáte až pri stúpaní k lesu. Z diaľky tieto sviežo zelené kopce pripomínajú driemajúce sopky na malajských ostrovoch. Naozaj krásne. Ak budete mať chôdze po kamenitom, vápencovom chodníčku už dosť, vrátite sa späť na modrú, ktorá vás prevedie lesom cez Závršie. V sedle za Závrším je turistický rozdeľovník a tak si môžete ujasniť, kde sa to vlastne nachádzate. Modrá, je to veľmi dobre značená, a tak sa nie je čoho obávať. Asi po hodine ostrej chôdze sa zrazu vynoríte na futbalovom ihrisku. Bolo to pre mňa veľké prekvapenie, že uprostred lesu je také veľké ihrisko, takmer regulárnych rozmerov. Musí byť radosť si tu zahrať. Ako som sa dozvedel, patrí divine a často sa tu usporiadavajú „lesné“ futbalové turnaje.\r\n\r\nZ ihriska odbočíte vpravo dole neoznačenou cestou a už po 20 minútach budete v osade Čambalovci. Tam sa napojíme na asfaltku, ktorá vás zvedie do Rudinskej Tarabovcov ku kostolu. Je tu i autobusová zastávka, ale my si chceme ešte vychutnať pohľad na vstupnú bránu na Kysuce a tak sa pustíme okolo rudinského ihriska hore cez polia a stočíme to po vyjazdenej ceste na Pálenicu. Pod sebou uvidíte Neslušu veľkú časť Kysuckej vrchoviny na jednej strane a okolo potoka tiahnucu sa Rudinu na strane druhej. Prejdete tak celým lesom za Pálenicou až sa dostanete takmer na začiatok Rudiny priamo k hostincu Silemon, kde majú dobré pivo. Odtiaľ už je to k železničnej zastávke približne 2km. Vlaky od Žiliny jazdia veľmi často, v pracovné dni takmer každú hodinu. Dúfam, že na našich turistických skratkách príliš nezablúdite a šťastne sa dostanete domov.', 6, '2009-01-27 23:00:01', 'štrkáč', 1, , 0, 11);
INSERT INTO `clanok` (`clanok_id`, `main_section_id`, `nazov`, `short_text`, `big_text`, `section_id`, `datetime`, `user`, `comments`, `image`, `home`, `counter`) VALUES
(9, 31, 'Kriváňska Malá Fatra  2 - Malý Kriváň, Suchý, Strečno', '<b> VELKÝ KRIVÁŇ – PEKELNÍK – MALÝ KRIVÁŇ – SUCHÝ – CHATA POD SUCHÝM – STARÝ HRAD STREČNO – NEZBUDSKÁ LÚČKA – HRAD STREČNO – 17KM</b>\r\nAk sa vám na Malej Fatre zapáčilo, poďte s nami na ďalšiu, tentoraz  oveľa náročnejšiu túru, na ktorej prejdeme takmer polovicu M. Fatry po hlavnej hrebeňovke a dokonca navštívime aj dve historické pamiatky.\r\n', '<b> VELKÝ KRIVÁŇ – PEKELNÍK – MALÝ KRIVÁŇ – SUCHÝ – CHATA POD SUCHÝM – STARÝ HRAD STREČNO – NEZBUDSKÁ LÚČKA – HRAD STREČNO – 17KM</b>\r\nAk sa vám na Malej Fatre zapáčilo, poďte s nami na ďalšiu, tentoraz  oveľa náročnejšiu túru, na ktorej prejdeme takmer polovicu M. Fatry po hlavnej hrebeňovke a dokonca navštívime aj dve historické pamiatky.\r\n\r\nAk ste čítali predchádzajúci príspevok už viete, ako sa na toto krásne pohorie dá dostať a ako sa dostanete až do Snilovského sedla. Určite použite lanovku (výťah), aby ste ušetrili dostatok síl na dosť drsný zostup, ktorý vás v závere s istotou neminie, a na ktorý aj ja dodnes spomínam. Ale poďme po poriadku!<br />\r\nOd lanovky sa dajte po červenej TZ smerom na Veľký Kriváň (1709m), aby ste sa dostali na magistrálu, ktorej sa budete držať až do konca túry. Behom polhodinky už budete na hlavnom hrebeni, kde sa môžete rozhodnúť či zdolať V. Kriváň, hore vľavo, alebo upaľovať na MALÝ KRIVÁŇ (1671m), dole vpravo, lebo cesta je ešte ďaleká. Rozhodnutie nechám na vás, lebo každý sám najlepšie vie ako je na tom so silami. Nenechajte sa zmiasť pohodovou chôdzou po krásnom chodníku. Počasie sa môže rýchlo zmeniť a sily môžu u menej trénovaných chýbať.<br />\r\nAle späť na trasu. Ešte než dorazíte na Malý Kriváň (od lanovky asi za 2 hod.),všimnite si v jednom úseku zmenu farby zeminy, ktorá je tmavohnedá až takmer červená. Je to na vrchole PEKELNÍK (1609m), ktorý snáď práve pre toto sfarbenie dostal tento názov. Inak celá hrebeňovka až po SUCHÝ (1468m), patrí k tým najkrajším, po ktorých som doposiaľ chodil.<br />\r\nJe odtiaľ perfektný výhľad na všetky strany, skaliská sú len v určitých úsekoch a dajú sa ľahko prekonať a aj medzi kosodrevinami sa dá dobre vykľučkovať. Všade dookola je plno krásnych kvetov a medveďov, ktorí sa turistom zatiaľ vyhýbajú a tak je radosť sa tu nerušene pohybovať.<br />Keď asi po troch hodinách dorazíte na Suchý, ukončíte tak túru po hrebeňoch a budú vás čakať už len zostupy. Ten na CHATU POD SUCHÝM patrí k tým príjemnejším hlavne preto, že na chate môžete zregenerovať sily, doplniť potraviny a hlavne tekutiny, premasírovať si chodidlá a psychicky sa pripraviť na nepríjemný, asi dvojhodinový zostup lesom, pri ktorom si niektorí z vás možno siahnu až na dno. Ale nechcem vás strašiť! Faktom je, že pri tomto strmom zostupe veľmi trpia kolená a hlavne už dosť unavené svaly a tak vrelo odporúčam, aby ste si zobrali turistické palice, alebo si našli palice smrekové. Verte, že sa vám budú hodiť!\r\n<br />Ja zasa verím, že všetky nástrahy prírody zvládnete a že sa celí a zdraví objavíte pri zrúcaninách STARÉHO HRADU STREČNO, ktorý je ukrytý v blízkosti červenej TZ a stojí to za to sa v jeho útrobách poprechádzať. Je odtiaľ krásny výhľad na Váh a celé údolie.<br />\r\nDo NEZBUDSKEJ LÚČKY už je to necelá hodina a tak, keď sa budete plaviť na kompe cez Váh, zaspomínajte, čo všetko ste na tejto túre zažili, koľko krásnej prírody ste videli a pokiaľ sa vám zdalo, že toho bolo málo, vyberte sa ešte na HRAD STREČNO a pozrite si túto jedinečnú historickú pamiatku, ktorá sa vypína na bradle nad Váhom.<br />\r\nPrajem vám, aby sa vám tento výlet vydaril, a aby ste na túto túru a na mňa spomínali len v dobrom.', 21, '2009-01-22 22:00:01', 'štrkáč', 1, , 0, 9);
INSERT INTO `clanok` (`clanok_id`, `main_section_id`, `nazov`, `short_text`, `big_text`, `section_id`, `datetime`, `user`, `comments`, `image`, `home`, `counter`) VALUES
(10, 31, 'Javorníky 2', '<b>  2. Zákopčie – U Rulcov – Petránky – Vrchrieka – Zákopčie u Holých – Husárik – Čadca (13 km)</b><br />Naše prvé kroky budú smerovať na autobusovú stanicu v Čadci, kde o 9.15 hod. odchádza autobus smer Zákopčie – Balalov. My však vystúpime na otočke autobusov u Rulcov. <br />Odtiaľ stúpame po modrej turistickej značke cestou zakladateľa turistiky na Kysuciach V. Galvánka. \r\n', '<b>  2. Zákopčie – U Rulcov – Petránky – Vrchrieka – Zákopčie u Holých – Husárik – Čadca (13 km)</b><br />Naše prvé kroky budú smerovať na autobusovú stanicu v Čadci, kde o 9.15 hod. odchádza autobus smer Zákopčie – Balalov. My však vystúpime na otočke autobusov u Rulcov. <br />Odtiaľ stúpame po modrej turistickej značke cestou zakladateľa turistiky na Kysuciach V. Galvánka. \r\n\r\nAsi po hodinke nenáročného stúpania, ktoré by zvládol aj zdatnejší cyklista, dôjdeme až nad Petránky na Vrchrieku (861m.n.m.), odkiaľ je naozaj prekrásny výhľad na Kyuscké a Moravsko-Sliezske Beskydy a oproti nám stále zasneženú Malú Fatru zo „zubatým“ Veľkým Rozsutcom a Veľkým Kriváňom. <br />\r\nZ Vrchrieky sa dáme doľava po červenej turistickej značke po hrebeni Javorníkov a asi po 1,15 hod. narazíme na žltú značku kde sa pustíme smerom dole na Zákopčie u Holých. Tam si môžeme oddýchnuť a občerstviť sa v miestnom pohostinstve. <br />Odtiaľ už je to len kúsok do osady Grečovci, odkiaľ známym chodníkom po červenej turistickej značke sa cez Husárik vrátime do Čadce. Keby sa vám niekedy zdalo, že značenie je biedne a značiek málo, nemýlite sa. Vandali sa nájdu všade, dokonca aj v horách.', 3, '2009-01-28 22:00:01', 'štrkáč', 1, , 0, 18);
INSERT INTO `clanok` (`clanok_id`, `main_section_id`, `nazov`, `short_text`, `big_text`, `section_id`, `datetime`, `user`, `comments`, `image`, `home`, `counter`) VALUES
(11, 31, 'Javorníky 3', '<b>  3.   Čadca Kyčerka – Husárik – Zákopčie Holých – Blážkovci – Vrchrieka – Mičekovci – Klinkovci – Ochodnica  (15 km)</b> \r\nPre toho, komu sa nechce cestovať do Ochodnice vlakom, či autobusom, tu mám typ na spoľahlivú skratku ktorá vedie prekrásnou prírodou.', '<b>  3.   Čadca Kyčerka – Husárik – Zákopčie Holých – Blážkovci – Vrchrieka – Mičekovci – Klinkovci – Ochodnica  (15 km)</b>\r\nPre toho, komu sa nechce cestovať do Ochodnice vlakom, či autobusom, tu mám typ na spoľahlivú skratku ktorá vedie prekrásnou prírodou. \r\n\r\n\r\n\r\nV Čadci sa pustíte priamo po červenej turistickej značke smerom k hotelu Husárik. Ďalej pokračujete do osady Grečovci, cez ktorú prejdete a po 10-tich  minútach po poľnej ceste odbočíte doprava. \r\n\r\nTáto poľná cesta vás dovedie na Zákopčie u Holých odkiaľ sa po žltej značke vydáte smerom hore až sa znova napojíte na červenú magistrálu. Týmto sa vyhnete zdĺhavému obchádzaniu Chotárneho kopca. Po červenej značke pokračujete až na Vrchrieku nad Petránkami, odkiaľ sa môžete pokochať pohľadom na všetky horské masívy z blízkeho ale i ďalekého okolia. Z Vrchrieky pokračujete dole po modrej TZ, cestou zakladateľa kysuckej turistiky V. Galvánka. \r\n\r\nNezabudnite sa na chvíľku zastaviť u Mičekovcov, kde sa nachádza útulné posedenie na lavičke pod Ježišom v nadživotnej veľkosti. Celá kysucká vrchovina je odtiaľ ako na dlani. Pri putovaní po Javorníkoch ďalej pokračujete po modrej turistickej značke až na rázcestie Klinkovci, odkiaľ sa môžete dostať do Kysuckého Nového Mesta, Nesluše a Ochodnice. Ja som sa rozhodol zabočiť doľava, smer osada Klinkovci a za ¾ hodiny som už pil pivo v Ochodnici. Onedlho som nastúpil na vlak smer Čadca s dobrým pocitom z pôsobivej túry. ', 4, '2009-01-28 21:00:01', 'štrkáč', 1, , 0, 11);
INSERT INTO `clanok` (`clanok_id`, `main_section_id`, `nazov`, `short_text`, `big_text`, `section_id`, `datetime`, `user`, `comments`, `image`, `home`, `counter`) VALUES
(12, 31, 'Javorníky 4', '<b>  4.   Turzovka – Bukovina - Solisko – Jakubovský vrch – Sedlo pod Grapou – Kamenité – Dlhá nad Kysucou – Turzovka (13km)</b> \r\nJavorníky si môžete prejsť nielen z Čadce a blízkeho okolia, ale môžete sa zviesť vlakom do Turzovky, ja som zvolil spoj  7.35 s odchodom z Čadce smer Makov. ', '<b>  4.   Turzovka – Bukovina - Solisko – Jakubovský vrch – Sedlo pod Grapou – Kamenité – Dlhá nad Kysucou – Turzovka (13km)</b> \r\nJavorníky si môžete prejsť nielen z Čadce a blízkeho okolia, ale môžete sa zviesť vlakom do Turzovky, ja som zvolil spoj  7.35 s odchodom z Čadce smer Makov.\r\n\r\n\r\nV tomto prípade máte pred sebou ďalšiu nezabudnuteľnú túru a budete bohatší o výstupy na ďalšie vrcholy „Čadčianskych Javorníkov.“ \r\n\r\nHneď po vystúpení z vlaku v Turzovke sa dá prejsť rovno cez koľaje na asfaltovú cestu, ktorá vedie k celoročne otvorenej chate „Bukovina“, pri ktorej budete asi za 20 minút. \r\n\r\nOd chaty pod lyžiarskym vlekom vedie neoznačený chodník ktorým sa odstanete približne za 15 minút ku kaplnke a k turistickému rozcestníku trás Na Bukovine. Je to dobrá skratka, ktorá vám pomôže, aby ste nemuseli obchádzať veľkú časť Turzovky. Z Bukoviny sa vyberiete po modrej turistickej značke pekným lesným chodníkom. Prejdete cez osadu Bugáňovci a Valčumovci a širokou lesnou cestou, ktorá sa stáča doprava, sa za necelú hodinku dostanete na Solisko. Nie je to síce to tatranské, ale je odtiaľ tiež pekný výhľad na Turzovskú Vrchovinu a Moravskosliezske Beskydy. Pod Jakubovským vrchom (874m.n.m.) som stretol aj na pasúce sa stádo oviec, ktoré zrejme prišlo po žltej značke zo Zákopčia od Polievkov. \r\n\r\nVy sa ale stále držte modrej značky a miernym stúpanim lesom sa dostanete na Jakubovský vrch ( od Soliska je to asi 1 hodina). \r\n\r\nTam zmeníme modrú za červenú turistickú značku a po Javorníckej magistrále smerom vpravo hľadajte Sedlo pod Grapou. S miernymi obtiažami ho určite nájdete, avšak dajte si pozor, aby ste sa znova napojili na červenú značku v osade Mračkov! Nenechajte sa zviesť cestou dole, ale hľadajte červenú na chodníku vľavo, aby ste sa šťastne dostali na Kamenité, kde je novovybudovaná rozhľadňa, z ktorej výhľad určite stojí zato. Mne v tento deň počasie neprialo, a tak som to hneď stočil po zelenej značke do Dlhej na Kysucou, kde som bol asi za ¾ hodiny. Tam som v príjemnej reštaurácii počkal na autobus do Turzovky, ktorý išiel o 13.45. \r\n\r\nPešom za dobrého počasia by sa to na stanicu do Turzovky za hodinu určite dalo zvládnuť. Spoje do Čadce cez týždeň chodia takmer každú hodinu, preto nie je problém si túru predĺžiť návštevou Turzovky, kde nájdete taktiež mnoho zaujímavostí.', 5, '2009-01-28 20:00:01', 'štrkáč', 1, , 0, 3);
INSERT INTO `clanok` (`clanok_id`, `main_section_id`, `nazov`, `short_text`, `big_text`, `section_id`, `datetime`, `user`, `comments`, `image`, `home`, `counter`) VALUES
(14, 31, 'Kysucká vrchovina 2', '<b>  2.   Kysucké Nové Mesto – Budatínska Lehota – Pod Poľanou – Steny – Holý vrch – Ľadonhora – Horný Vadičov – Kubaščíkovci (13km)</b> \r\nPre náročnejších turistov by som odporučil výstup na najvyšší vrchol Kysuckej vrchoviny, na Ľadonhoru (999m.n.m.). na túto túru je potrebné dobre sa obuť, zásobiť tekutinami aj pokiaľ je možnosť „vyzbrojiť“ sa aj trekovými palicami. V mojom prípade som cestoval vlakom z Čadce o 7.33 hod. do Kysuckého Nového Mesta. ', '<b>  2.   Kysucké Nové Mesto – Budatínska Lehota – Pod Poľanou – Steny – Holý vrch – Ľadonhora – Horný Vadičov – Kubaščíkovci (13km)</b>\r\nPre náročnejších turistov by som odporučil výstup na najvyšší vrchol Kysuckej vrchoviny, na Ľadonhoru (999m.n.m.). na túto túru je potrebné dobre sa obuť, zásobiť tekutinami aj pokiaľ je možnosť „vyzbrojiť“ sa aj trekovými palicami. V mojom prípade som cestoval vlakom z Čadce o 7.33 hod. do Kysuckého Nového Mesta. \r\n\r\nZo stanice sa nasmerujete na modrú turistickú značku, aby ste prešli most do Budatínskej Lehoty. Prejdete túto príjemnú dedinku s miernym stúpaním a po chvíli budete v tichej prírode tvorenej poväčšine borovicovým lesom. Asi po 1 a pol hodine už budete u rozdeľovníka Pod Poľanou, odkiaľ sa stále po modrej turistickej značke stočíte doprava pod Steny s krásnym výhľadom na K.N.M., Javorníky a Kysucké Beskydy. Keď dôjdete na križovatku s rúbaniskom, budete márne hľadať turistickú značku. Nestrácajte nádej a dajte sa rúbaniskom smerom priamo hore, kde narazíte po chvíli na modrú turistickú značku. Po hodine „slušného“ stúpania budete na Stenách (887m.n.m.).  \r\n\r\nSteny spolu s Holým vrchom (912m.n.m.) tvoria takmer štvorkilometorvý dlhý chrbát skalnatého útvaru s husto porastenými bukmi. Chodník je úzky a tak je treba dávať si pozor, aby ste v poriadku došli do sedla pod Ľadonhorou, kde vás bude čakať záverečný, avšak veľmi náročný výstup po šmykľavom teréne, ktorý si bez trekových palíc ani neviem predstaviť. Asi po pol hodine to ale určite zvládnete a pokoríte tak túto majestátnu horu. Zostup do Horného Vadičova je dosť náročný, lebo chodník je strmý a šmykľavý. Ak toto všetko zvládnete, odmenou vám bude výhľad do najkrajšej kysuckej doliny – Vadičovskej nad ktorou sa ako Himaláje vypína, v mojom prípade ešte zasnežená, Malá Fatra. Z Horného Vadičova je veľmi dobrý autobusový spoj smer K.N.M. Želám vám, aby ste na tejto túre stretli len starších osamelých turistov, tak ako stretávam ja a nie starších osamelých medveďov, ktorí sa tu občas zatúlajú.', 7, '2009-01-27 22:00:01', 'štrkáč', 1, , 0, 4);
INSERT INTO `clanok` (`clanok_id`, `main_section_id`, `nazov`, `short_text`, `big_text`, `section_id`, `datetime`, `user`, `comments`, `image`, `home`, `counter`) VALUES
(15, 31, 'Kysucká vrchovina 3', '<b>3.   Kysucké Nové Mesto – Radoľa  - Veľký Vreteň (8 km)</b> \r\nKeď už sa raz nachádzame v Kysuckej vrchovine, bola by veľká škoda nenavštíviť Veľký Vreteň. Túto mohutnú stolovitú horu môžete sledovať už z vlaku, keď pôjdete z Čadce do K.N.M. vypína sa ako pyramída nad Radoľou po ľavej strane od vlakovej stanice. ', '<b>3.   Kysucké Nové Mesto – Radoľa  - Veľký Vreteň (8 km)</b> \r\nKeď už sa raz nachádzame v Kysuckej vrchovine, bola by veľká škoda nenavštíviť Veľký Vreteň. Túto mohutnú stolovitú horu môžete sledovať už z vlaku, keď pôjdete z Čadce do K.N.M. vypína sa ako pyramída nad Radoľou po ľavej strane od vlakovej stanice. \r\n\r\n\r\nPreto naším ďalším cieľom je Radoľa, do ktorej sa dostanete po zelenej turistickej značke. Z vlaku vystúpite v K.N.M. a pôjdete na smer obchodného domu LIDL a potom cez most, ktorý vedie priamo do Radole. Držíte sa stále zelenej turistickej značky a po asfalte prejdete celou touto dedinou. Bola by však škoda nezastaviť sa na začiatku dediny pri známom Radoľskom kaštieli. Táto pekná historická pamiatka určite stojí za povšimnutie. Po prehliadke sa vrátite späť na zelenú značku a po necelej hodine chôdze už stojíte pod ďalším velikánom Kysuckej vrchoviny – Veľkým Vreteňom (820m.n.m.). Na prvý pohľad vás jeho mohutnosť možno zaskočí, ale ten, kto si chce vyskúšať svoj fyzický potenciál, pustí sa s chuťou do výstupu. Serpentínovitý chodník je dobre značený a dobre udržiavaný.  \r\n\r\nŽiadne nečakané prekážky vás po ceste neprekvapia. Len si treba dávať pozor na všade napadané lístie, aby ste sa nepošmykli. Výstup je síce značne jednotvárny (medzi bukmi) a ani výhľadu si príliš neužijete. Ale pocit, že ste zdolali tohto velikána určite stojí zato. Mne sa to podarilo asi za 50 min. je to ideálna hora pre súťaživých jednotlivcov. Podľa mňa by sa tu kľudne dala usporiadať horská časovka pre peších turistov. Veľký Vreteň je na to ako stvorený. Po mierne náročnej túre zídeme späť tým istým chodníkom a môžeme si chvíľku posedieť na lavičke pod už pokorenou horou. Tou istou cestou sa potom vrátime do Radole, kde na začiatku dediny je veľmi príjemný motorest, kde sa môžete občerstviť. Verte, že budete naozaj spokojní, keď absolvujete tento výstup a zdoláte tohto „drobčeka“.', 8, '2009-01-27 21:00:01', 'štrkáč', 1, , 0, 4);
INSERT INTO `clanok` (`clanok_id`, `main_section_id`, `nazov`, `short_text`, `big_text`, `section_id`, `datetime`, `user`, `comments`, `image`, `home`, `counter`) VALUES
(16, 31, 'Kysucká vrchovina 4', '<b> 4.   Horný Vadičov–Košariská – Nad Melišovcami – Zlieň – Údolie za Zlieňom – Horný Vadičov – vyhliadka pod Ľadonhorou – chata pod Ľadonhorou – Dolný Vadičov (12km)</b> \r\nTen, kto chce vidieť naozajstnú krásu, nech sa vyberie na túto túru. Určite nebude ľutovať, tak ako aj ja. Obľúbeným ranným vlakom o 7.33 hod. som išiel z Čadce do K.N.M. a odtiaľ z 3. stanovišťa som autobusom pokračoval do Horného Vadičova – Košariská (konečná).', '<b> 4.   Horný Vadičov–Košariská – Nad Melišovcami – Zlieň – Údolie za Zlieňom – Horný Vadičov – vyhliadka pod Ľadonhorou – chata pod Ľadonhorou – Dolný Vadičov (12km)</b> \r\nTen, kto chce vidieť naozajstnú krásu, nech sa vyberie na túto túru. Určite nebude ľutovať, tak ako aj ja. Obľúbeným ranným vlakom o 7.33 hod. som išiel z Čadce do K.N.M. a odtiaľ z 3. stanovišťa som autobusom pokračoval do Horného Vadičova – Košariská (konečná). \r\n\r\nV pracovných dňoch autobus chodí o 8.20 hod. a v nedeľu o 8.35. Zo zastávky Košariská sa vyberiete smerom hore po ceste až k turistickému rozdeľovníku pod Ľadonhorou. Odtiaľ sa vydáte po modrej značke, ktorá vás bude viesť okolo prírodného amfiteátru a vadičovského potoku lesnou cestou. Asi za hodinku vás dovedie k rozdeľovníku Nad Melišovcami, odkiaľ sa dáte doprava po červenej a asi po 10 min. prejdete zalesneným Zlieňom (765m.n.m.). Keď vyjdete z lesa, odbočte hneď doľava (bez značenia) a o chvíľku budete v najkrajšej doline na Kysuciach, aspoň podľa môjho názoru. Zasnežená Malá Fatra na vás zapôsobí, akoby ste boli niekde vo švajčiarskych, alebo rakúskych Alpách. \r\n\r\nKrížom krážom som si pochodil toto údolie, ktoré by som nazval údolie za Zlieňom. (Nemýľte si ho však so Sedlom pod Zlieňom). Pokiaľ budete mať krásnej  prírody a panorámy Malej Fatry málo, vráťte sa tou istou cestou až pod Ľadonhoru a vychutnajte si celú Vadičovskú dolinu až k vyhliadke pod Ľadonhorou. V tomto prípade kopírujete zelenú turistickú značku, ktorá vás vedie úpätím Ľadonhory. Výhľad na celú rozkvitnutú dolinu je úchvatný. Priamo oproti sa vypína Magura a za ňou v celej svojej nádhere Krivánska Malá Fatra. Pod vami sa nachádza celá, do zelena odetá, Kysucká vrchovina s vyčnievajúcim Veľkým Vreteňom (820m.n.m.). Z vyhliadky sa pustíte dole lesom po zelenej a vyjdete u chaty pod Ľadonhorou, ktorá je však už niekoľko rokov mimo prevádzky. Odtiaľ už je to len 20 min. do Dolného Vadičova, kde vyjdete priamo u občerstvovacej stanice (príjemnej krčmy) hneď vedľa autobusovej zastávky do K.N.M. ten, kto raz príde do Vadičovskej doliny, určite sa sem zase vráti. Ja som to spravil tento rok už niekoľkokrát. Bol som aj na Magure, odkiaľ je úchvatný pohľad na Ľadonhoru z vtáčej perspektívy. Tiež som si obišiel Ľadonhoru z druhej strany od veľmi pekného horského hotela Hájnica. Po zelenej turistickej značke až na Skrížené. \r\n\r\nTam som sa napojil až na žltú a obišiel som tak Ľadonhoru, Holý vrch a Steny po širokej lesnej ceste až do Budatínskej Lehoty a ďalej do K.N.M. Mimochodom vo Vadičove je skupinka nadšencov, ktorí pravidelne usporadúvajú zimný výstup na Ľadonhoru. Mňa tento nápad tiež zaujal, tak som absolvoval jeden zimný súkromný výstup. Keďže som súťaživý typ a rád skúšam náročnejšie výstupy, vydal som sa na vrchol od rozdeľovníka nad Kubaščíkovcami po modrej turistickej značke. Podľa mapy by výstup mal trvať 1:35 hod, podľa značenia 1:20 hod a mne sa to podarilo za 48 minút. Bolo to celkom náročné, no stálo to za to!', 9, '2009-01-27 20:00:01', 'štrkáč', 1, , 0, 3);
INSERT INTO `clanok` (`clanok_id`, `main_section_id`, `nazov`, `short_text`, `big_text`, `section_id`, `datetime`, `user`, `comments`, `image`, `home`, `counter`) VALUES
(17, 31, 'Kysucké Beskydy 1 - Veľká Rača', '<b> OŠČADNICA ZAST. – KALINOVÝ VRCH -  CHATY NA RAČI – VELKÁ RAČA – OŠČADNICA LALIKOVCI – 16 KM</b> \r\nČo by sme to boli za Kysučanov, keby sme nenavštívili najvyšší vrchol Kysuckých Beskýd, <b>Veľkú Raču!</b>Na Veľkú Raču sa dá dostať takmer zo všetkých strán Kysuckých aj Poľských Beskýd. Ja som pre vás vybral trasu, ktorá je vhodná pre peších turistov, ale aj pre horských cyklistov.', '<b> OŠČADNICA ZAST. – KALINOVÝ VRCH -  CHATY NA RAČI – VELKÁ RAČA – OŠČADNICA LALIKOVCI – 16 KM</b> \r\nČo by sme to boli za Kysučanov, keby sme nenavštívili najvyšší vrchol Kysuckých Beskýd, <b>Veľkú Raču!</b>Na Veľkú Raču sa dá dostať takmer zo všetkých strán Kysuckých aj Poľských Beskýd. Ja som pre vás vybral trasu, ktorá je vhodná pre peších turistov, ale aj pre horských cyklistov.\r\n\r\nZačneme na vlakovej zastávke v Oščadnici, kam sa z Čadce dostanete za necelých 10 minút.<br />Tam aj začína modrá turistická značka, ktorej sa budete držať takmer celú cestu.<br />Najprv ale musíte prekročiť rieku Kysucu! Ak použijete železný most bude to bez problémov a bez premočených topánok. Potom už suchou nohou budete pokračovať okolo píly, prejdete hlavnú cestu , za ktorou sa stočíte vpravo a po poľnej ceste budete stúpať smer KALINOVÝ VRCH (816 m.n.m.) Je to pekné, tiahle stúpanie, pri ktorom si hlavne cyklisti prídu na svoje. Peším turistom by to na Kalinov vrch nemalo trvať viac ako 1 hod. 20 minút. Keď budete mať šťastie na pekné počasie, uvidíte odtiaľ takmer celú Kysuckú vrchovinu. Aj príroda sa tu už začína meniť a pribúda viac bučín, ktoré sú tak typické  pre oblasť V. Rače.<br />Ak pridáte do kroku, tak za 50 minút už môžete odpočívať v Kolibe na Rači, alebo v inej reštaurácii, ktorých je v SNOW PARADISE v Dedovke nad vlekom, dostatok. Dá sa tu nielen odpočívať, ale aj zajazdiť si na koňoch, motokárach, a pod. Je tu toho až dosť!\r\n\r\nS aktivitou to ale moc neprežeňte, lebo vás za chvíľu čaká záverečný výstup. Z areálu CHATY NA RAČI sa napojíte na zelenú turistickú značku  a krásnym chodníkom chránenej oblasti budete stúpať až na najvyšší vrch Kysúc, na VELKÚ RAČU (1236 m). Mali by ste to zvládnuť asi za 50 minút. Nezabudnite sa ale zastaviť pri chránenej prírodnej pamiatke SKALNÉ DIERY, ktoré sú tak trochu skryté pred zrakmi verejnosti. Patria medzi pseudokrasové ( nepravé krasové ) javy. Zaujímavé, ako si príroda sama vytvorila malé jaskyne v skale.<br />Na samom vrchole sa vám určite bude páčiť. Keď som raz stál na vyhliadke, práve tam dorazil jeden poľský turista a povedal: „Tie gury su ale krásne !„  Mal pravdu. Z Rače je naozaj krásny výhľad na České a Poľské  Beskydy, na Malú Fatru a ďalšie pohoria. Je tu tiež poľská horská chata, kde môžete platiť aj slovenskými korunami (eurami).<br />Naspäť sa budete vracať tým istým chodníkom a o to viac si môžete vychutnávať krásnu prírodu CHKO KYSUCE.<br />Z križovatky Chaty na Rači sa dáte opäť po modrej, ale tentoraz smerom do Oščadnice – Lalíkovci, kde by ste mali pohodovým tempom doraziť asi za 30 minút. Je tam konečná zastávka autobusu s dobrým spojom do Čadce.\r\n\r\nKeby sa vám zdalo, že pod Račou je akosi veľa cyklistov v pretekárskych dresoch, tak ste práve prišli na jeden z pretekov slovenského pohára v zjazde (downhill) , ktorý sa tu pravidelne každoročne koná. Býva tu skvelá účasť s poprednými svetovými pretekármi. Minulý rok tu bola aj jedna z popredných zjazdárov svetového formátu, Austrálčanka T. Hanach. Nezabudnite si takýto pretek pozrieť! Lebo to, čo dokážu títo pretekári na bicykli v takomto náročnom teréne, je priam neuveriteľné.', 10, '2009-01-23 23:00:01', 'štrkáč', 1, , 0, 5);
INSERT INTO `clanok` (`clanok_id`, `main_section_id`, `nazov`, `short_text`, `big_text`, `section_id`, `datetime`, `user`, `comments`, `image`, `home`, `counter`) VALUES
(18, 31, 'Kysucké Beskydy 2 - Trojmezí (Trojhraničie)', '<b> ČIERNE – TROJMEZÍ – HRČAVA – GÍROVÁ – STUDENIČNÉ – MOSTY U JABLUNKOVA -  11 km</b> \r\nTúlanie po Kysuckých Beskydoch začneme tentokrát na Čiernom. Z Čadce  je ideálny ranný spoj vlakom o 6 hod. 37 min. ktorý vás asi po 20 minutách zavezie na Čierne – zastávku, priamo k novovybudovanému turistickému chodníku. Hneď za koľajami vás privíta orientačná tabuľa, z ktorej sa dozviete veľa zaujímavostí o tomto regióne.', '<b> ČIERNE – TROJMEZÍ – HRČAVA – GÍROVÁ – STUDENIČNÉ – MOSTY U JABLUNKOVA -  11 km</b>\r\nTúlanie po Kysuckých Beskydoch začneme tentokrát na Čiernom. Z Čadce  je ideálny ranný spoj vlakom o 6 hod. 37 min. ktorý vás asi po 20 minutách zavezie na Čierne – zastávku, priamo k novovybudovanému turistickému chodníku. Hneď za koľajami vás privíta orientačná tabuľa, z ktorej sa dozviete veľa zaujímavostí o tomto regióne.\r\n\r\nNašim prvým cieľom na tejto veľmi peknej túre bude TROJMEZÍ , ku ktorému  vás privedie  asi po 30 minútach zelená turistická značka. \r\n\r\nUrčite vás prekvapí novovybudovaný, krásny areál s lávkami, ktoré vedú zo slovenskej a poľskej strany, aby sa stretli v Čechách. Je to ojedinelé stretnutie troch štátov. V r.1994 tu boli blízko seba osadené tri žulové monolity, z ktorých každý stojí na území iného štátu. Mňa tu čakalo ešte jedno prekvapenie. Poľský skaut, ktorý tu prespal, aby tu bol prvý na Deň skautingu /1.8./ na stretnutí skautov troch tak príbuzných národov. \r\nZ Trojmezí sa potom po žltej držte smerom na HRČAVU, ktorá bude našou ďalšiou zastávkou. Aj tu sa máte na čo pozerať! Táto rázovitá horská dedinka má veľké množstvo dobre udržiavaných historických pamiatok, ako napr. drevený kostol, drevenú školu a pod.\r\nZ Hrčavy ďalej choďte po zelenej značke chodníkom, ktorý je priam ideálny pre horských cyklistov a v zime pre bežkárov. A tak tu často môžete stretnúť odvážnych lyžiarov z Čierneho, Lacka Štetiara, Ferka Stráňavu a Milka Purka.\r\nZ Čierneho sa tak voľnou chôdzou asi po  2,5 hod. dostanete ku chate GÍROVÁ, nad ktorou sa vypína aj rovnako nazývaný kopec /863 m.n.m./ Tento vrch je veľmi dobre vidno z Čadce a nedá sa pomýliť. Z diaľky vyzerá akoby mal vo svojom strede vyšliapaný chodníček od chaty až na vrchol. Skúste si po tomto chodníčku dať výstup na čas! Ak to zvládnete pod 4 minúty a nie ste trénovaní, tak ste fakt dobrí. Mne sa to podarilo za 3, 27 min., ale mal som toho dosť.\r\n\r\nMožno je lepšie sa pomaly „vyšplhať„ až hore ku nivelačnému kameňu a vychutnávať si ten prekrásny výhľad na rady slovenských horstiev, ktoré máte ako na dlani. Keď sa nabažíte krásnej krajiny, určite si radi posedíte v tichučkej horskej chate.\r\nPod chatou sa potom napojíte na červenú, ktorej sa budete držať až do cieľa našej cesty. Pohodovým krokom sa tak po 45 minutách dostanete na STUDENIČNÉ. Je tu tiež veľmi pekná chata, kde sa dá výborne naobedovať a dokonca si tu môžete aj zaplávať v malom, ale milom prírodnom bazéne.\r\n\r\nDo MOSTOV U JABLUNKOVA je to len čo by kameňom dohodil a tak si odpočinku na Studeničnom užite do sýtosti. Čaká vás už len nenáročná chôdza dole lesom, okolo pekného cyklistického areálu, ktorý často využívajú členovia nášho klubu. Je to už blízko ku vlakovej stanici, odkiaľ sa už ľahko dostanete späť na Slovensko a už konečne bez colnej kontroly!', 11, '2009-01-23 22:00:01', 'štrkáč', 1, , 0, 4);
INSERT INTO `clanok` (`clanok_id`, `main_section_id`, `nazov`, `short_text`, `big_text`, `section_id`, `datetime`, `user`, `comments`, `image`, `home`, `counter`) VALUES
(19, 31, 'Kriváňska Malá Fatra 1 - Veľký Kriváň, Chleb', '<b> VRÁTNA – SNILOVSKÉ SEDLO – VEĽKÝ KRIVÁŇ -  CHLEB – HROMOVÉ – CHATA POD CHLEBOM – SNILOVSKÉ SEDLO – VRÁTNA (9 km) </b>Túlanie po krásnej Malej Fatre začneme pre začiatok nenáročnou, ale veľmi peknou túrou, na ktorej, bez veľkého zadýchania, zdoláte dva najvyššie vrcholy Kriváňskej Malej Fatry', '<b> VRÁTNA – SNILOVSKÉ SEDLO – VEĽKÝ KRIVÁŇ -  CHLEB – HROMOVÉ – CHATA POD CHLEBOM – SNILOVSKÉ SEDLO – VRÁTNA (9 km) </b>Túlanie po krásnej Malej Fatre začneme pre začiatok nenáročnou, ale veľmi peknou túrou, na ktorej, bez veľkého zadýchania, zdoláte dva najvyššie vrcholy Kriváňskej Malej Fatry\r\n\r\n\r\nMalá Fatra patrí k môjmu najobľúbenejšiemu pohoriu a ten, kto ju aspoň raz navštívi, určite si ju zamiluje. So svojou nadmorskou výškou je toto pohorie ideálne pre peších turistov, už menej pre horských cyklistov, aj keď sa tu občas tiež nájdu. Flóra už je tu odlišnejšia od tej našej, beskydskej a tak pre nás zaujímavejšia a príťažlivejšia. Poďme sa spoločne pozrieť na tieto „Terchovské Himaláje!“<br />Najprv ale musíte prísť do Žiliny čo najskôr a potom zo Žiliny do Vrátnej (smer Terchová) . Z autobusovej stanice je premávka v pracovné dni dosť častá, o víkendoch je to žiaľ horšie. Autobus vás zavezie prakticky až ku kabínkovej lanovke vo Vrátnej, ktorá začína prevádzku o 8. 30 hod. a vyvezie vás za 280 SK ( spiatočná 320 SK ) až do SNILOVSKÉHO SEDLA (1524m), takmer až pod VELKÝ KRIVÁŇ (1709m) .\r\n\r\nOd lanovky sa dajte po červenej značke po dosť frekventovanom kamenitom chodníku a behom polhodiny už budete stáť na najvyššom vrchole M. Fatry a kochať sa prekrásnou okolitou krajinou. Keď sa dostatočne pokocháte, zbehnite naspäť do Snilovského sedla, stále po červenej magistrále a navštívte druhý najvyšší vrchol – CHLEB (1646m).<br />Z V. Kriváňa by vám to nemalo trvať viac ako hodinu. Aj odtiaľto je naozaj prekrásny výhľad!<br />Určite bude váš zrak priťahovať „zubatý“ Veľký Rozsutec, vysoký, zelený Stoh a ďalšie vrcholy, ktoré neskoršie tiež navštívime.\r\n\r\nKeď sa ale budete držať plánu našej túry, napojíte sa za Chlebom, v oblasti HROMOVÉHO, na žltú turistickú značku a budete po nej, vpravo dole, zostupovať pekným kosodrevinovým chodníkom až k CHATE POD CHLEBOM. Je to typická horská chata s celoročnou prevádzkou. Dá sa tu najesť, napiť a dokonca aj prenocovať, pokiaľ sú voľné miesta. V blízkom okolí si všimnite krásne, sýto modré trsy kvetov Horca horského, ktorý sa tu hojne vyskytuje, a ktorý si môžete dať v chate v tekutom stave. Pravdou je, že je skutočne horký, ale dobrý! Až keď ich vypijete viac, horkosť sa začne akosi vytrácať... Na chate sa môžete zdržať dlhšie, lebo už vás čaká len záverečná prechádzka sedlom, medzi Chlebom po pravej strane a V. Kriváňom po ľavej. Z chaty to zvládnete do 40 minút. Tí unavenejší tak budú už v cieli našej túry a lanovkou sa zvezú dole do Vrátnej. Tí zdatnejší sa môžu vybrať dole po svojich, po zelenej značke (pod lanovkou) a môžu si tak pozrieť trasu Downhill pretekov, ktoré sa tu prvýkrát konali v roku 2007, no tento rok tam budú opäť. Môžete si aspoň urobiť predstavu, čo všetko musí pretekár absolvovať.<br />Vy sa ku chate Vrátna určite dostanete, lebo ste neponechali nič náhode a určite ste sa dobre obuli, obliekli, zásobili tekutinami a tak vás ani vietor, ani zima a ani spaľujúce slnko nemôžu ničím prekvapiť a z Malej Fatry si s istotou odnesiete len tie najkrajšie zážitky.', 12, '2009-01-22 23:00:01', 'štrkáč', 1, , 0, 4);
INSERT INTO `clanok` (`clanok_id`, `main_section_id`, `nazov`, `short_text`, `big_text`, `section_id`, `datetime`, `user`, `comments`, `image`, `home`, `counter`) VALUES
(20, 31, 'Sliezske Beskydy 1', '<b> 1.    Jablunkovo-Návsí – Filipka – Hrádek ve Slezsku (9 km)</b> \r\nČo takto sa vydať za hranice všedných dní? Čadca má tú výhodu, že je prakticky hraničným mestom a že je to odtiaľto len na skok do Sliezskych a Moravsko-Sliezskych Beskýd. Túto oblasť mám tiež obľúbené turistické trasy, ktoré som neraz prešiel a preto som vybral niekoľko trás ako tipy pre váš výlet. ', '<b> 1.    Jablunkovo-Návsí – Filipka – Hrádek ve Slezsku (9 km)</b> \r\nČo takto sa vydať za hranice všedných dní? Čadca má tú výhodu, že je prakticky hraničným mestom a že je to odtiaľto len na skok do Sliezskych a Moravsko-Sliezskych Beskýd. Túto oblasť mám tiež obľúbené turistické trasy, ktoré som neraz prešiel a preto som vybral niekoľko trás ako tipy pre váš výlet. \r\n\r\n\r\nDo Jablunkova nemusíte chodiť len za nákupmi, ale môžete tam ísť na turistiku. Najlepším spoj do Jablunkova na letnú túru je z Čadce osobným vlakom o 6.37 hod. ( v mojom prípade), alebo rýchlikom s konečnou stanicou v Brne s odchodom 7.13 hod. z Čadce, ktorý tiež v Jablunkove stojí. Keď vystúpite na stanici Jablunkov-Návsí, prejdite cez cestu a na druhej strane uvidíte žltú turistickú značku, ktorej sa budete držať. Povedie vás medzi domami po asfaltovej ceste a behom desiatich minúť ste už v krásnej tichej prírode. Určite sa obzrite za seba, pričom uvidíte nielen celý Jablunkov, ale hlavne troch Moravsko-Sliezskych velikánov: Kozubovú so žiariacou strechou turistickej chaty, zalesnený Ostrý, ktorý sa vypína v strede a na pravom kraji Javorový s mohutným anténovým systémom. Tieto tri vrchy vás budú z diaľky sprevádzať po celej trase. Cesta vás prevedie zápolím a mierne sa budete stáčať vľavo lesnou cestou smer Filipka (762m.n.m.). najkrajšia časť výstupu vás však ešte len čaká. Asi za 45 min. dorazíte do veľmi pekného údolia, ktoré som nazval „Jalovcové“.  Nie preto, že by tu nalievali borovičku, ktorá sa vyrába z plodov jalovca, ale preto, že sa tu popína jalovec v rozlohe 1.11 ha po celej dĺžke údolia. Je to tiež chránená prírodná pamiatka. Určite si vychutnajte túto krásu s po nej vás už len čaká trocha príkrejší, asi 10 min. výstup, pričom už budete prakticky v srdci Sliezskych Beskýd – na Filipke(762m.n.m.).\r\n\r\nNachádza sa tam križovatka ciest kde si môžete vybrať trasy podľa svojej vôle a nálady. Na vrchole je veľmi pekný hraničný kameň – rozdeľovník trás a akási „odpočívareň“, ktorá je jedinou vadou na kráse inak prekrásneho prostredia. Ak sa rozhodnete poprechádzať sa po hrebeni, uvidíte celé jablunkovsko s Moravsko-Sliezskymi Beskydami a časť Sliezskych Beskýd s Veľkým Stožkem, tiež uvidíte Veľký Sošov a Veľkou Čantoryí. Na začiatok zvolíme ľahšiu túru a vyberieme sa doľava po žltej a po chvíli nás určite upúta krásna drevenička, ktorá zapadá do typického prostredia. Neďaleko nej je chata s občerstvením. Asi po desiatich minútach dôjdete na Filipku – rázcestie, kde sú ďalšie ukazovatele. Tam zmeníme farbu trasy a po zelenej značke pomaly klesáme smer Hrádek ve Slezsku. Je to široká lesná cesta, ktorú tiež využívajú cykloturisti. Sliezske Beskydy a predovšetkým oblasť Filipka a okolie sú rajom pre horských cyklistov. Sú tu ideálne cesty s výborným značením a ten, kto chce niekedy vyšliapnuť napríklad na alpský Grossglockner (môjmu bratovi sa to podarilo už trikrát), je to ideálne miesto na tréning. Asi po ďalších desiatich minútach sa zelená značka stáča vľavo, pričom kráčate veľmi pohodlnou cestou s pekným výhľadom na M.-S. Beskydy a celú jablunkovskú brázdu s nepekne dymiacim Třincom. Po chvíli klesáte dole ku chate Hrádek obklopenej lyžiarskymi vlekmi. V tomto období sa tu už lyžovať nedá, ale je tu možnosť zahrať si tenis, alebo si dať niečo dobré v chate. Teraz vás už čaká len záverečný zostup pohodlnou nenáročnou cestou stále po zelenej okolo „zámočku“ a po chvíli ste v Hrádku ve Slezsku, ktorý bol pôvodným miestom založenia Jablunkova. Odtiaľ sa už osobným vlakom zveziete do Čadce, alebo smerom na Český Těšín. Táto túra nie je náročná a preto je vhodná pre celú rodinu.', 13, '2009-01-25 23:00:01', 'štrkáč', 1, , 0, 4);
INSERT INTO `clanok` (`clanok_id`, `main_section_id`, `nazov`, `short_text`, `big_text`, `section_id`, `datetime`, `user`, `comments`, `image`, `home`, `counter`) VALUES
(21, 31, 'Sliezske Beskydy 2', '<b>  2.   Jablukovo-Návsí – Filipka – Loučka v pasekách – Bystřice nad Olší (11 km)</b> Ďalšiu trasu Sliezskymi Beskydami opäť v Jablunkove-Návsí. Pre nás už známou cestou po žltej trase stúpame na Filipku. Volím túto trasu zámerne, lebo je to najkratšia cesta ( asi 4 km) nie príliš fyzicky náročná, ktorú zdolajú určite aj deti, pričom je veľmi pekná hlavne vďaka priľahlým M.-S. Beskydom a tzv. „jalovcovému“ údoliu pod Filipkou.', '<b>  2.   Jablukovo-Návsí – Filipka – Loučka v pasekách – Bystřice nad Olší (11 km)</b> Ďalšiu trasu Sliezskymi Beskydami opäť v Jablunkove-Návsí. Pre nás už známou cestou po žltej trase stúpame na Filipku. Volím túto trasu zámerne, lebo je to najkratšia cesta ( asi 4 km) nie príliš fyzicky náročná, ktorú zdolajú určite aj deti, pričom je veľmi pekná hlavne vďaka priľahlým M.-S. Beskydom a tzv. „jalovcovému“ údoliu pod Filipkou.\r\n\r\nKeď sa budete nachádzať na vrchole Filipky (762m.n.m), tí zdatnejší už po hodine túry, dáte sa doľava stále po žltej značke a na Filipke rázcestí nikam neodbočujte, ale choďte priamo hore lesným chodníkom stále rovno. Nebojte sa, že zablúdite. Všetky trasy v Sliezskych Beskydoch sú perfektne značené (naši „označovatelia“ by tam mali chodiť na školenie). Nestretnete sa tu s tým, že by niektorý ukazovateľ bol nečitateľný, alebo poškodený. Je naozaj radosť sa pohybovať v týchto končinách, pričom mapu ani nemusíte používať. Nenáročným stúpaním asi tak po 20 min. zvládnete Loučku (835m.n.m.), chvíľku pôjdete po rovinke upravenou cestou smerujúcou do osady, ale vy sa budete držať žltej značky a vľavo dole budete klesať turistickým chodníkom smer Bystřice nad Olší. Hneď pod kopcom je veľmi pekná turistická chata Loučka, žiaľ pre celý rok 2007 uzavretá. Je to veľká škoda, pretože by sa tam dalo pekne posedieť a obzrieť si historické poľnohospodárske stroje, ktoré sú vystavené v okolí chaty. Avšak vy sa môžete občerstviť až v Pasekách v hostinci pri otočke autobusu, alebo v kolibe, ktorá je ale otvorená až od 12.00 hod. do Bystřice vám ostávajú necelé 4 km túry a tak určite nečakajte na autobus, ale pustite sa asfaltovým chodníkom napravo okolo koliby a za necelú hodinku prídete ku drevenému kostolu založenému v roku 1898, ktorý stojí zato, aby ste si ho prezreli, pretože takýchto historických pamiatok už nenájdete veľa.\r\n\r\nOd kostola k vlakovej stanici ( smerom naľavo) je to už necelý kilometer a tak už o chvíľu budete odpočívať na zastávke v Bystřici nad Olší a kochať sa pohľadom na nám už dobre známych troch velikánov M.-S.- Beskýd, Kozubovú, Ostrý a Javorový. Je možné, že nad Javorovým uvidíte pestré farby padákov, lebo vyznávači paragliding tiež nezaháľajú a často sa z Javorového spúšťajú a krúžia dlhé hodiny nad jablunkovskou brázdou a M.-S. Beskydami. Táto túra tiež nie príliš náročná, no horskí cyklisti sa na nej už trošku potrápia. No i pre nich táto trasa nie je nezdolateľná, keďže som stretol asi 100 kilogramového cyklistu, ktorý bol sfarbený viac dočervena ako moje tričko, no nevzdával sa a bojoval až do posledných síl. Týmto som chcel povedať to, že turistika, či už pešia alebo na bicykli, je vhodná naozaj pre každého.', 14, '2009-01-25 22:00:01', 'štrkáč', 1, , 0, 2);
INSERT INTO `clanok` (`clanok_id`, `main_section_id`, `nazov`, `short_text`, `big_text`, `section_id`, `datetime`, `user`, `comments`, `image`, `home`, `counter`) VALUES
(22, 31, 'Sliezske Beskydy 3', '<b>    3.   Jablunkov-Návsí – Filipka – Veľký Stožek – Malý Stožek – Veľký Sošov – Veľká Čantoryje – Nýdek (20 km)</b>\r\nPre tentokrát som vybral naozaj náročnú, ale krásnu trasu. Ak sa rozhodnete absolvovať ju, zdoláte tak na jedenkrát všetky najznámejšie vrcholy sliezskych Beskydov s najvyššou horou Čantoryjov. Na Filipku už cestu poznáte z predchádzajúcich príspevkov, a tak si len osviežime pamäť, že z Jablunkova-Návsí vás žltá turistická značka dovedie až na vrchol Filipky.', '<b>    3.   Jablunkov-Návsí – Filipka – Veľký Stožek – Malý Stožek – Veľký Sošov – Veľká Čantoryje – Nýdek (20 km)</b>\r\nPre tentokrát som vybral naozaj náročnú, ale krásnu trasu. Ak sa rozhodnete absolvovať ju, zdoláte tak na jedenkrát všetky najznámejšie vrcholy sliezskych Beskydov s najvyššou horou Čantoryjov. Na Filipku už cestu poznáte z predchádzajúcich príspevkov, a tak si len osviežime pamäť, že z Jablunkova-Návsí vás žltá turistická značka dovedie až na vrchol Filipky.\r\n\r\nOd rozdeľovníka trás sa tentokrát dáte doprava po červenej značke „hrebeňovke“, kde sa asi po 1,5 km napojíte na žltú, ktorá vás nasmeruje na pohraničnú modrú a červenú značku. Tie nás prevedú napravo lesom až na Veľký Stožek (978m.n.m.). Výstup je dosť náročný, úzkym chodníkom občas s prekážkami – popadanými stromami, ale pre skúseného turistu to nie je žiadny problém.  Vtedy, keď už budete spotení stáť na skale a nič neuvidíte, tak sa budete nachádzať na Veľkom Stožku. Výhľad, bohužiaľ, nie je prakticky žiadny, ale ak zídete kúsok nižšie k poľskej turistickej chate, otvorí sa vám prekrásny panoramatický výhľad na celé Poľské Beskydy. Keď však budete chcieť absolvovať celú plánovanú trasu príliš sa nezdržujte a zbehnite späť po spoločnej modrej a červenej značke na Malý Stožek. Tam už je pripravená pohraničná cesta, po ktorej sa vydáte za ďalšími vrcholmi. Je to široká turistická cesta, po ľavej strane značená modrou ( česká strana) a po pravej strane červenou ( poľská strana ) turistickou farbou.\r\n\r\nŽiaľ modrá sa často stráca v lese, zrejme kvôli hranici, preto sa radšej držte poľskej červenej značky, ktorá vás bezpečne dovedie na Čantoryju (995m.n.m.). Cyklistov som tu síce nestretol, ale aj pre nich by to bola dobrá trasa, až na niektoré strmé stúpania v závere. Takmer po celej trase je pekný výhľad na Beskyd Zywiecky ( Poľské Beskydy), výhľadu na Sliezske Beskydy bráni les. Týmto sa pôjdete prakticky stále rovno popri hraničných kameňoch a už po 2,5 km bez problémov zdoláte ďalší známy vrchol – Veľký Sošov (886m.n.m.). v okolí Veľkého Sošova je chodník stále viac kamenitý. Chvíľami si budete pripadať ako v tatrách, ale je stále široký a celkom pohodlný. Keď od Sošova pridáte do kroku a rýchlejšie zvládnete posledné stúpanie, tak už 1 hod. a 40 minút budete pod rozhľadňou najvyššej hory Sliezskych Beskýd – Veľkej Čantoryje (995m.n.m.). V prípade pekného počasia môžete vystúpiť ( za určitý poplatok) na rozhľadňu, odkiaľ je úchvatný výhľad. Všetky poľské, české a slovenské pohoria ako na dlani, dokonca aj Tatry sa dajú vidieť. Na môj vkus je tu ale rušno, kde v bufetoch, stánkoch a iných zariadeniach vám poľskí obchodníci predajú aj nafukovacieho krokodíla. Z tohto rušného miesta sa opäť pustíme po modrej značke ku chate na Čantoryji, kde sa dá v kľude posedieť, aj keď chata rok od roku viac chátra. V časti hrebeňa sa rozprestiera národná prírodná pamiatka Čantoryja v rozlohe takmer 40 ha. Je pralesovitého charakteru tvorená prevažne bukovo – jedľovým lesom a niekoľkými tysami, ktoré patria v Beskydoch k ojedinelým. Môžete sa vydať aj po rytierskej cestičke. Podľa povesti sú Čantoryskí rytieri stáročia skrytí v skale, a keď bude Slezanom najhoršie, prídu na pomoc. Stále som hľadal túto skalu, až napokon som jeden skalnatý útvar našiel, kde podľa povesti títo rytieri odpočívajú.\r\n\r\nKeď sa dáte od rozdeľovníka pod chatou po červenej značke smerom na Nýdek, nájdete pamätnú dosku J. Třanovského, evanjelického duchovného, ktorý bol v 17. storočí prenasledovaný za svoju vieru práve v týchto miestach sa konali tajné bohoslužby. Vedie tadiaľ i rytierska cestička, a tak možno aj v týchto skalách rytieri stále ešte spia a čakajú na svoju príležitosť. Ak sa budete držať červenej turistickej značky, po troch kilometroch už budete v Nýdku na námestí, kde je otočka autobusov s dobrým spojom do Bystřice nad Olší. Ja som stihol autobus o 15.05 hod. v Nýdku sú tiež dve historické zaujímavosti. Červeno žiariaci kostol na kopci neďaleko námestia a asi 300m po ceste menší drevený kostolík. Pokiaľ vám ostalo ešte dosť síl, neváhajte a choďte si ich pozrieť.', 15, '2009-01-25 21:00:01', 'štrkáč', 1, , 0, 1);
INSERT INTO `clanok` (`clanok_id`, `main_section_id`, `nazov`, `short_text`, `big_text`, `section_id`, `datetime`, `user`, `comments`, `image`, `home`, `counter`) VALUES
(23, 31, 'Turistika úvod', '<h4 align="left"><u>Milí priaznivci turistiky a cykloturistiky, návštevníci Kysúc<br /></u></h4><p align="left">Krásna kysucká príroda nás obklopuje zo všetkých strán, no nie len pre to sme sa rozhodli priblížiť Vám náš región a ponúknuť tak niekoľko tipov na túry, cyklotúry, prechádzky a rodinné výlety. Dúfame že na nasledujúcich stránkach nájdete cenné informácie, ktoré Vám pomôžu pri plánovaní víkendovej vychádzky, alebo aj niekoľkodennej dovolenky strávenej v tomto malebnom kraji. Stačí si obuť pohodlné turistické topánky, alebo nazuť cyklistické tretry a vydať sa po našich stopách. Veríme že zažijete neopakovateľné okamžiky na potulkách kysuckou prírodou.', '<h4 align="left"><u>Milí priaznivci turistiky a cykloturistiky, návštevníci Kysúc<br /></u></h4><p align="left">Krásna kysucká príroda nás obklopuje zo všetkých strán, no nie len pre to sme sa rozhodli priblížiť Vám náš región a ponúknuť tak niekoľko tipov na túry, cyklotúry, prechádzky a rodinné výlety. Dúfame že na nasledujúcich stránkach nájdete cenné informácie, ktoré Vám pomôžu pri plánovaní víkendovej vychádzky, alebo aj niekoľkodennej dovolenky strávenej v tomto malebnom kraji. Stačí si obuť pohodlné turistické topánky, alebo nazuť cyklistické tretry a vydať sa po našich stopách. Veríme že zažijete neopakovateľné okamžiky na potulkách kysuckou prírodou. <br />\r\n\r\nTešíme sa na stretnutie na turistických chodníkoch na Kysuciach.<br /><br />Milan a Milan Chrtovci /Down Hill Čadca/</p><h4 align="left"><br /><u>Niekoľko slov na úvod</u></h4><p align="left"> Chránená krajinná oblasť Kysuce sa nachádza v severozápadnej oblasti Slovenska a pozostáva z dvoch od seba navzájom oddelených častí: západnej Javorníckej a východnej Beskydskej. Západnú časť tvoria Javorníky, Turzovská vrchovina a Moravskoslezské Beskydy. Východnú časť tvoria Kysucké Beskydy, Kysucká vrchovina a Oravské Beskydy.<br /> Geologicky sa územie Kysúc skladá prevažne z treťohorných flyšových hornín, kde sa striedajú pieskovce a bridlice, Na juhu a juhovýchode tu zasahuje druhohorné bradlové pásmo Kysucká vrchovina.</p><h2><br /><br /><br /><strong>1. Javorníky (1-4)</strong><br /><br /><strong>2. Kysucká vrchovina<br /></strong><br />a.) Kysucká brána<br />b.) Ladonhora<br />c.) Veľký Vreteň<br />d.) Zlieň <br /><br /><strong>3. Turzovská vrchovina<br /></strong><br /><strong>4. Sliezske Beskydy (1-3)</strong><br /><br /><strong>5. Za krásami a tajomstvami kysuckej prírody<br /></strong><br />a.) Okružná jazda okolo Čadce<br />b.) Megoňky<br />c.) Pramene</h2><h2><strong>6. Kysucké Beskydy</strong> <br /><br />a.) Veľká Rača<br />b.) Trojhraničie</h2><h2><strong>7. Malá Fatra<br /></strong><br />a.) Veľký Kriváň, Chleb<br />b.) Malý Kriváň, Suchý, Strečno</h2>', 0, '2010-00-00 00:00:00', 'štrkáč', 1, , 0, 21);
INSERT INTO `clanok` (`clanok_id`, `main_section_id`, `nazov`, `short_text`, `big_text`, `section_id`, `datetime`, `user`, `comments`, `image`, `home`, `counter`) VALUES
(24, 31, 'Turzovská vrchovina', '<b>Nižný Kelčov – Pokrývky – Huslov – Kmínek – Bumbálka – Súkennícka rozhľadňa – Salajka – Makov  (18 km)</b>Z Turzovskej vrchoviny som vybral moju najobľúbenejšiu túru, pri ktorej sa prejdeme po slovensko-českej hranici a nazrieme aj do moravskosliezskych Beskýd.', '<b>Nižný Kelčov – Pokrývky – Huslov – Kmínek – Bumbálka – Súkennícka rozhľadňa – Salajka – Makov  (18 km)</b>Z Turzovskej vrchoviny som vybral moju najobľúbenejšiu túru, pri ktorej sa prejdeme po slovensko-českej hranici a nazrieme aj do moravskosliezskych Beskýd. \r\n\r\n\r\n<br />Tentoraz začneme v Nižnom Kelčove. Tam sa dostaneme motoráčikom smerom na Makov. Najlepšie je využiť skorý ranný spoj z Čadce o 6:30 hod, alebo o 7:35 hod. vláčik vás prevezie takmer celou Turzovskou dolinou a už za 45 min. budete z Nižného Kelčova stúpať po zelenej turistickej značke smerom k horskej chate Kmínek.  \r\n\r\nNajprv ale musíte prejsť ponad tichučkého Pokrývky, ktoré sú usadené v krásnej panenskej prírode vo výške 766 m.n.m. o čistote ovzdušia tu svedčí veľké množstvo machov a lišajníkov, ktoré môžete vidieť len v čistých vysokohorských oblastiach, ako sú Vysoké Tatry a podobne. Z Pokrývok vás turistický chodník stočí vpravo dole do malebnej osady Huslov, z ktorej už budete stále len stúpať až na Kmínek. Nad Huslovom sa zelená turistická značka zmení na červenú a tak sa jej budete držať až k sedlu nad Bitalovcami. Tam je rozdeľovník trás a smerovky k horským chatám a tak zase po zelenej dostanete k slovenskej horskej chate Kmínek, ktorú som vybral ako prvú zastávku. Je tam veľmi dobré posedenie v peknom prostredí priamo na slovensko-českej hranici. Dokonca si tu môžete aj zaplávať, lebo je tu veľký prírodný bazén, a tak o načerpanie nových síl je tu dostatočne postarané. Keby ste ale mali chuť na českú kuchyňu, zbehnite si na „knedlo, vepřo, zelo“ na chatu Snežná, ktorá je odtiaľ asi 300 metrov. Je to už na českej strane, ale dá sa tu platiť aj slovenskými korunami (možno aj eurami). \r\n\r\nOddýchnutí a posilnení sa potom pustíte po červenej turistickej značke, ktorá vedie priamo po hranici. Občas preskočíte hraničný kameň a po štyroch kilometrov príjemnej chôdze budete na Bumbálke. Tá je skôr známejšia ako lyžiarske stredisko, ale práve zo zjazdoviek je krásny výhľad na Moravskosliezske Beskydy, ktoré vás aj s Lysou horou sprevádzajú po celej hraničnej trase. \r\n\r\nNašim cieľom je ale súkennícka rozhľadňa a tak na Bumbálke prejdeme rušnú hlavnú cestu, aby sme po chvíli boli v krásnej prírode M. S. Beskýd. Súkennícka rozhľadňa už vykúka ponad stromy a priam turistov láka k rýchlejšiemu kroku. Z Bumbálky to bude trvať asi 15 minút, keď pôjdete po žltej turistickej značke. Potom už len aby ste mali 20 českých korún, vyšliapali 130 schodov a z vtáčej perspektívy môžete sledovať veľkú časť Javorníkov a takmer celé M. S. Beskydy z vyčnievajúcou Lysou horou. Trocha som si pripadal ako apoštol na pražskom orloji, keď som vykukával z okienka a posúval sa do ďalšieho, ale panoramatickému pohľadu z rozhľadne sa asi nič nevyrovná. \r\n<br />Tak sme sa pozreli a môžeme pomaly myslieť na návrat. Vracať sa budeme tým istým chodníkom na Bumbálku, odkiaľ si na chvíľu odskočíme po žltej značke do pralesa. Lepšie povedané do prírodnej rezervácie Salajka, ktorú tvorí bukovo jedľový porast s bohatým bylinným podrastom. Vek niektorých jedlí odborníci odhadujú až na 300  rokov. Príroda a čas tu vytvorili pralesovitý vzhľad tejto 22 hektárov veľkej rezervácie a určite stojí zato si ju pozrieť. <br />Zo Salajky vybehnite na vám už známy hraničný chodník a budete sa držať červenej až k Masarykovej chate. Za ňou sa napojíte vpravo na modrú turistickú značku, ktorej sa budete držať až k vlakovej zastávke Makov. <br />Verím, že sa vám táto pohodová prechádzka bude páčiť, a že sa sem budete vracať častejšie.\r\n\r\nNa záver by som chcel poďakovať veľkému milovníkovi prírody a odborníkovi na Turzovskú vrchovinu Ferkovi Pavlíkovi, ktorý mi bol na tejto túre odborným poradcom.', 16, '2009-01-26 23:00:01', 'štrkáč', 1, , 0, 19);
INSERT INTO `clanok` (`clanok_id`, `main_section_id`, `nazov`, `short_text`, `big_text`, `section_id`, `datetime`, `user`, `comments`, `image`, `home`, `counter`) VALUES
(28, 31, 'Strážovské vrchy 1 - Súľovské skaly', 'Súľov parkovisko – hrad Súľov – Roháč – Roháčske sedlo – Keča – sedlo Pastúch – Kamenný diel – Zbyňov – Rajecké Teplice (16 km)\r\n\r\nNajkrajšou a najtajomnejšou oblasťou strážovských vrchov je jednoznačne skalnatý hrebeň v severovýchodnej časti - Súľovské skaly. Tak sa poďme poprechádzať pomedzi tieto impozantné treťohorné zlepence.\r\n', 'Keď sa chcete dostať čo najbližšie pod Súľovský hrad a užiť si pritom krásnej prírody, je najlepšie využiť autobus. Spoj z Bytče, (priamy autobus zo Žiliny nechodí), ktorý vám ochotne zastaví v Súľove – parkovisko, kde sú aj informačné tabule a rozdeľovník trás. \r\nNajlepšie je vydať sa po zelenej TZ, po náučnom chodníku, priamo hore. Súľovské skaly vás hneď vtiahnu do svojho labyrintu a už vás nepustia. Ale nebojte sa, keď budete opatrný, nemáte sa čoho obávať. Jedine tak Buba Buba, ktorý tu žije a keď budete pozorne čítať náučné tabule na cestičke, dozviete sa toho omnoho viacej. Ja som tu napríklad stretol tri zatúlané ovečky, ktoré má na úzkom kamenitom chodníku prekvapili viac, než by to bol medveď. Zrejme už ich nebavilo popásať sa na pastvinách v Súľove a vydali sa tiež na túru. \r\nPo pol hodine nenáročného stúpania sa zrazu ocitnete v gotickej bráne krásneho skalnatého výtvoru, ktorý sa hneď tak nevidí. Po ďalšej polhodinke stúpania medzi tiesňavami už budete stáť na Súľovskom hrade, ktorý bol postavený v 15. storočí. Z pôvodného hradu sú už zachované len zvyšky hradných múrov a chodba vytesaná v skale. Klobúk dole pred tými, ktorí v tomto zložitom teréne hrad postavili. Keď sa prederiete až na samotný vrchol, budete mať perfektný výhľad na Strážovské vrchy s impozantnou Bradou( 816 m.n.m.), ktorá je najvyšším vrcholom. Nezabudnite si prezrieť reliéf skál oproti vás, lebo práve tam budú smerovať vaše ďalšie kroky a prakticky po hrebeňoch prejdete celú túto dlhú oblasť.\r\nZ hradu sa potom pustíte dolu, stále po zelenej TZ, ku lúke pod hradom, odkiaľ už po červenej TZ budete miernym stúpaním smerovať na Roháč (803 m.n.m.), kde by ste asi za hodinu mali doraziť. Až na roháč je to celkom pohoda, horšie časy nastanú, ak sa po zelenej TZ vydáte až do sedla Pastúch. Budete si tak trochu pripadať ako na hojdačke, lebo náročné výstupy striedajú zostupy, ktoré za dažďa môžu byť dosť nepríjemné. Ale keď chcete vidieť členitosť súľovských skál s mnohými vežami, ihlami a zbrázdenými skalnými stenami, musíte túto tiahlu časť absolvovať. Nezabudnite si za Roháčom odskočiť na vyhliadku, odkiaľ je prekrásny výhľad, prevažne na tú časť Súľovský skál, ktoré už máte za sebou.\r\nSedlo Pastúch by ste mohli dosiahnuť asi za 2,5 hodinky. Tam vám príde odpočinok vhod, ale to najnáročnejšie už máte za sebou. Po žltej TZ, ktorá je aj cyklotrasou, vás čaká už len pohodová chôdza lesnou cestou na Kamenný diel (653 m.n.m.) a ďalej potom peknou prírodou až do dedinky Zbyňov, kde už je civilizácia aj občerstvenie. Keď budete príliš smädný, ste tam za 40 minút. Po ďalej hodinke chôdze popri Rajčianke už budete v cieli našej túry, v Rajeckých Tepliciach, ktoré sú ideálnym kúpeľných mestečkom na relax po krásnom, ale náročnom výlete.\r\n', 0, '2009-01-20 23:00:01', 'Štrkáč', 1, '', 0, 1);
INSERT INTO `clanok` (`clanok_id`, `main_section_id`, `nazov`, `short_text`, `big_text`, `section_id`, `datetime`, `user`, `comments`, `image`, `home`, `counter`) VALUES
(25, 31, 'Okružná jazda okolo Čadce', '<b> Čadca – Husárik (740 m.n.m.) – Grečovci (751 m.n.m) – Črchla (885 m.n.m) – Vojtov vrch (840 m.n.m.) – osada Kýčera ( 700 m.n.m.) – chata Tri kopce (490 m.n.m ) – 12 km</b>Pre tých, ktorým sa za turistikou nechce príliš cestovať, mám pozvánku na „okružnú jazdu“ nad Čadcou. To platí ako pre peších, tak i pre cykloturistov. Na tejto túre môžete vidieť všetky pohoria, ktoré nás obklopujú a pekne z výšky, ako z rozhľadne, uvidíte, v akej krásnej krajine je Čadca rozostretá.', '<b> Čadca – Husárik (740 m.n.m.) – Grečovci (751 m.n.m) – Črchla (885 m.n.m) – Vojtov vrch (840 m.n.m.) – osada Kýčera ( 700 m.n.m.) – chata Tri kopce (490 m.n.m ) – 12 km</b>Pre tých, ktorým sa za turistikou nechce príliš cestovať, mám pozvánku na „okružnú jazdu“ nad Čadcou. To platí ako pre peších, tak i pre cykloturistov. Na tejto túre môžete vidieť všetky pohoria, ktoré nás obklopujú a pekne z výšky, ako z rozhľadne, uvidíte, v akej krásnej krajine je Čadca rozostretá.\r\n\r\n\r\nZačneme na Husáriku. Tento kopec miestni obyvatelia veľmi dobre poznajú, a kto ho nepozná, dostane sa naň  z Čadce po červenej turistickej značke, alebo zo sídliska Kýčerka panelovou cestou. Už pri stúpaní nad sídliskom, v osade Krkoškovci, môžete sledovať pásmo Moravskosliezsykch Berskýd. Na samom vrchu bielo svieti chata Severka a nižšie pod ňou chata Skalka. Nad Krkoškovcami, pri stúpaní po asfaltke, sa po ľavej strane tiahnu kysucké Beskydy s najvyššou horou Veľkou Račou.\r\n\r\nNa Husárik by ste mali dôjsť za necelú hodinu. Nad zjazdovkami je stúpanie trochu náročnejšie a tak keď nevládzete, tempo zvoľnite, alebo bicykel potlačíte. Horský hotel Husárik je už po rekonštrukcii a celý žiari novotou. Určite patrí k najkrajším horským hotelom na Slovensku. Kto bude ustatý, môže si odpočinúť pri kaplnke pod chránenými Tismi. Keď si sadnete a pozriete sa do diaľky, uvidíte časť krivánskej Malej Fatry s Malým a Veľkým Rozsutcom. Ďalej sa budete držať červenej turistickej značky a na rázcestí za Husárikom sa vyberiete doľava do osady Grečovci. \r\n\r\nKeď prejdete túto peknú drevenicovú osadu bez ujmi na zdraví, keďže pri poslednom dome stráži mrzutí pes na labilnej reťazi, vynorí sa vám dlhá panoráma Javorníkov s protiľahlou osadou Kýčera a osadami na Zákopčí po pravej strane. Od rozdeľovníka sa držte smeru na Chotárny kopec po červenej značke. Asi po 30 minútach dorazíte k prvým chalúpkam osady Burdovci. Osadou sa len prepletiete po vyšliapanom chodníku a budete stúpať na Črchlu, ktorú zdoláte asi po ďalších 20 minútach. \r\n\r\nZ črchli je nielen pekný pohľad na vzdialené M. S Beskydy, ale je spoločne s Chotárnym kopcom rajom pre zberačov čučoriedok a iných lesných plodov. Najkrajšie je ale pod Črchlou, a tak sa stočíte po zelenej dole vľavo a ste v príjemnom sedle, kde sa určite budú pásť ovečky. Nachádza sa tam aj novovybudované posedenie. Ovečky nechajte vkľude pásť a vy zase popáste svoje oči, lebo ako na tanieri je pred vami rozprestretá celá Kysucká vrchovina. Sprava vás upúta  svojou mohutnosťou Veľký Vreteň a naľavo od neho dlhý chrbát stien s Ľadonhorou. Vyzerajú ako práve natreté tmavomodrou farbou. Radosť pozrieť. A to sa v pozadí ešte vypína celá Krivánska Malá Fatra.\r\n\r\nVy ale musíte pokračovať ďalej po širokom, ovečkami spasenom chodníku, a po chvíli ste na Vojtovom vrchu, z ktorého je krásny výhľad na Čadcu, ktorá z výšky vyzerá akoby vtesaná do križujúcich sa horstiev. Ďalej vás chodník povedie cez množstvo kamenných kôp - hromadníc a približne za 50 minút sa ocitnete v tichej osade Kýčera. Niekedy mi to pripadá, akoby sa tu zastavil čas. na cintoríne, ktorý je za osadou, si môžete pozrieť jednu historickú pamiatku – najstarší kysucký náhrobný kameň, ktorý bol v roku 2007 renovovaný. \r\n\r\nPotom už budete smerovať dole, a asi za 30 minút sa ocitnete v sedle nad Riekou odkiaľ sú pekne vidieť Kysucké Beskydy s Veľkou Račou, pod ktorou sa každoročne konajú preteky Slovenského pohára v zjazde na horskom bicykli. Keby ste pokračovali stále rovno, prídete na sídlisko Žarec, ale kto je smädný, zíde priamo dole naľavo do Čadce-Rieky na chatu Tri kopce, kde je príjemné posedenie priamo pod lyžiarskym svahom. Je tu aj zastávka autobusu, a tak domov bezpečne určite dorazíte. Len musíte vystihnúť ten správny čas, aby ste stihli autobus, keďže tu premáva párkrát za deň. ', 17, '2009-01-24 23:00:01', 'štrkáč', 1, , 0, 2);
INSERT INTO `clanok` (`clanok_id`, `main_section_id`, `nazov`, `short_text`, `big_text`, `section_id`, `datetime`, `user`, `comments`, `image`, `home`, `counter`) VALUES
(26, 31, 'Megoňky', '<b> Kamenné gule v Megoňkách</strong></b>\r\nZa tajomstvami a záhadami nášho regionu naozaj nemusíme chodiť ďaleko. Stačí sadnúť v Čadci na autobus č.4 a nechať sa odviezť na konečnú do Milošovej-Megoniek. Naším cielom je tentoraz opustený kameňolom na konci dediny. Vyčnieva z lesa a prakticky sa dotýka hranice s Českou republikou. ', '<b> Kamenné gule v Megoňkách</strong></b>\r\nZa tajomstvami a záhadami nášho regionu naozaj nemusíme chodiť ďaleko. Stačí sadnúť v Čadci na autobus č.4 a nechať sa odviezť na konečnú do Milošovej-Megoniek. Naším cielom je tentoraz opustený kameňolom na konci dediny. Vyčnieva z lesa a prakticky sa dotýka hranice s Českou republikou. \r\n\r\n\r\nOd zastávky autobusu pri ňom budete  behom piatich minút. Určite vás prekvapí, tak ako mňa, že tu nieje ani jedna orientačná tabuľa, alebo smerovka k unikátom, ktoré tento kameňolom ukrýva.<br />Do spodnej části lomu Padyšák sa dostanete po hlavnej ceste, neskôr odbočkou do strednej časti a úzkým lesním chodníčkom celý kameňolom obídete.<br />Najviac vás dozaista upúta najäčšia a najznámejšia kamenná gula s priemerom 2,6m, ktorá je skutočne obrovská. Žial , je to v tejto lokalite posledný celistvý exemplár. Povetrnostné podmienky aj tu ukazujú svoju silu a je len otázkou času, dokedy tento posledný mohykán odolá. Samozrejme aj miestni občania nezaháľajú a menšie kamenné gule si smelo odvážajú na svoje záhradky a chaty. Avšak nad týmto velikánom zo skaly vyčnieva ďalšia,takmer pravidelná, oveľa menšia pologuľa ,ktorá akoby čakala na vyliahnutie zo skalného masívu. <br />\r\nO kúsok ďalej už je len zvyšok pologule a takmer na samom vrchu môžete vidieť miesto,odkial sa jedna z gúl kedysi dávno odlúpla skončila neznámo kde.<br />Keď sa prejdete po okolí lomu,narazíte v lese na jedno torzo menšej gule, ktorá odpočívav machu pod lesným chodníčkom. Ďalšie gule tu už nenájdete,ale sú vraj ukryté na vonkajšiej strane lomu. Ak budete mať štastie,možno dajakú objavíte!\r\n\r\nKeď sa nad týmito tajomnými skalnými útvarmi človek zamyslí a dlhšie sa na nich zahladí,určite to v každom z nás vyvolá zvláštný pocit.Prečo sa práve len na niktorých miestach,medzi ostrými skalnými stenami,vytvorily takmer dokonalé gulovité útvary?<br />Nad tým už si lámaly hlavy odborníci z mnohých kútov sveta a vyslovili vela názorov.<br />Ufológovia tvrdia,že to mohly vytvoriť len mimozemské civilizácie-možno,že tu kedysi  mimozemšťania hrávali bowling. Dráhu by tu mali dobrú,až po Klokočovské skálie!<br />Ale späť do reality. Geológovia sa prikláňajú k názoru,že kamenné gule vznikly v pravekom mori vplyvom špecifických podmienok usadzovania hornin,kde dochádzalo ku vzniku zhlukov pieskovcov a ich mechanickému nabalovaniu.<br />Najlepšie je presvedčiť sa na vlastné oči a urobiť si svoj vlastný názor. Pre vetšinu z nás ostane toto miesto stále záhadné a možno práve tu si uvedomíme, že príroda naozaj dokáže zázraky.', 18, '2009-01-24 22:00:01', 'štrkáč', 1, , 0, 4);
INSERT INTO `clanok` (`clanok_id`, `main_section_id`, `nazov`, `short_text`, `big_text`, `section_id`, `datetime`, `user`, `comments`, `image`, `home`, `counter`) VALUES
(27, 31, 'Pramene', 'Kto má rád minerálku priamo z prameňa, nebude váhať, spojí príjemné s užitočným a navštívi spolu s nami Čadcu-Vojty a Čadcu-Bukov.<br />Do Vojtov sa najlepšie a najrýchlejšie dostanete autobusom č.3, ktorým sa zveziete až na konečnú zastávku.Tam je prvý a posledný smerovník, ktorý vám napovie, že po modrej turistickej značke sa k prameňom dostanete. ', 'Kto má rád minerálku priamo z prameňa, nebude váhať, spojí príjemné s užitočným a navštívi spolu s nami Čadcu-Vojty a Čadcu-Bukov.<br />Do Vojtov sa najlepšie a najrýchlejšie dostanete autobusom č.3, ktorým sa zveziete až na konečnú zastávku.Tam je prvý a posledný smerovník, ktorý vám napovie, že po modrej turistickej značke sa k prameňom dostanete. \r\n\r\n\r\nJe to síce odvážne tvrdenie, lebo modrá sa už prakticky neobjaví, ale držte smer stále rovno a úspech bude zaručený. Po chvilke pri ceste objavíte drevenú šipku,na ktorej stojí, že ku prvému prameňu je to 200m. Musíte tomu uveriť, preskočiť potok a po vyšlapanom chodníku stúpať lesom za prvým dobrodružstvom. Keď sa vám začne triasť pôda pod nohami a ucítíte zápach síry, nebojte sa, nieste v pekle, ale u sirovodíkového prameňa-vajcovky. Voda svojim složením by mala byť obdobná ako vajcovka v Bukove, lebo sú na rovnakom tektonickom zlome. Voda ale presakuje do okolia a tak si miestami pripadáte akoby ste chodili po bažine. Dá sa tu aj oddýchnuť na okraji lesa na lavičke s peknou vyhliadkou po okolí.<br />\r\nK druhému prameňu je to odtiaľ presne 20minút. A tak zbehnete tým istým chodníkom opäť na cestu a pôjdete ďalej do hlbokého, temného lesa. Našťastie vás na ďalší lesný chodníček navedú modré značky, označujúce prameň. S ich pomocou a s vlastnou intuiciou ďalší prameň určite objavíte. Je to druhý Vojtovský minerálny prameň natrium-bikarbonového  tipu s nepravidelne silným výronom metánu. Viac o zložení vody a ďalších parametroch si môžete prečítať na informačnej tabuli, ktorá tu nechýba, na rozdiel od prameňa č.1.\r\n\r\nNajviac vás zrejme zaujme, že voda stále akosi žblnkoce. Chvíľami viac, chvíľami menej. Je  zaujímavé  tento jav pozorovať na hladine. Za toto všetko môže plyn metán, ktorý nepretržite tvorí tieto výrony. Ja som sa s takýmto javom v okolitých horách nikde doposiaľ nestretol. Je to ďalší unikát Kysuckej prírody.<br />Keď sa napijete tejto priezračnej vody a naplníte flaše, ktoré máte určite so sebou, môžete si posedieť na prírodnej lavičke, ktorá je nedaleko.<br />\r\nSpäť do Čadce je príjemná prechádzka s peknou zastávkou na chate Tri kopce, ktorá je celoročne v prevádzke v poobedňajších hodinách pri ktorej je aj zastávka autobusu.<br />No keď budete mať pramenitej vody stále málo, vydajte sa do Bukovskej doliny k tretiemu Čadčanskému prameňu. Zo stanice je to približne 40 minút. Trafíte tam veľmi ľahko. Pôjdete popri automobilke AVC sa potom zabočíte do ľava za TESCO, abyste sa náhodou nedostali až do tunela pod Capkovým vrchom. Kráčajte popri prúdu bukovského potoka, ktorý vás k "vajcovke" spoľahlivo dovedie. Tam vás čaká ozajstné prekvapenie, lebo celé okolie prameňa žiari novotou a voda sa dá čapovať skoro ako z vodovodu.<br />Behom niekoľkých hodín môžete porovnávať chuť minerálok z troch odlišných lokalít v blízkosti mesta Čadca.', 19, '2009-01-24 21:00:01', 'štrkáč', 1, , 0, 5);
INSERT INTO `clanok` (`clanok_id`, `main_section_id`, `nazov`, `short_text`, `big_text`, `section_id`, `datetime`, `user`, `comments`, `image`, `home`, `counter`) VALUES
(29, 31, 'Strážovské vrchy 2 - Strážov', 'Čičmany – Strážov – Čierny vrch – Vráblová – sedlo Samostrel – Čičmany (13 km)\r\n\r\nTentoraz tu máme niečo pre naozajstných milovníkov prírody a taktiež niečo pre obdivovateľov ľudovej architektúry. Na najvyšší vrchol Strážovských vrchov sa vyberieme z Čičmian, zo svetoznámej rázovitej horskej dediny, ktorú každoročne navštevuje veľa turistov.', 'Do Čičmian sa dopravíte autobusom zo Žiliny (zastávka číslo 20), buď priamo, alebo cez Rajec, odkiaľ je spojenie najlepšie. Z konečnej zastávky sa pustíte po červenej TZ, po asfaltke smerom na Zliechov. Asi po 1,5 km nezabudnite odbočiť vpravo na poľnú cestu!!!\r\nZnačenie je tu biedne a tak sa stále držte tejto širokej cesty, ktorá sa stáča vpravo takmer do protismeru. Asi po kilometri sa ocitnete na úzkom lesnom chodníku, ktorý vás už spoľahlivo dovedie ku cieľu našej túry. Stúpanie do Sedla pod strážovom je síce dosť náročné, ale pritom veľmi pekné, lebo sa budete pohybovať tichým, zmiešaným lesom pralesovitého typu, kde je toho veľa na obdivovanie. Les, do ktorého človek nezasahuje je omnoho tajomnejší a príťažlivejší a tak je treba chodiť len po vyznačených chodníkoch, tak ako všade v CHKO, aby sme flóru ani faunu v týchto oblastiach príliš nerušili. To platí predovšetkým o Lúke pod Strážovom, ku ktorej sa dostanete asi za 10 minúť zo sedla. Lúky sú vlastne dve, z tej prvej je krásne vidno Lučanskú Malú Fatru s Kľakom a na tej druhej zase , ako si príroda žije svoj nerušený život. Lúky, rokliny a skalnaté útesy Strážova sú domovom rôznorodej vzácnej kveteny a sú aj obľúbeným miestom botanikov. Ako som sa dočítal, vyskytujú sa tu aj vzácne druhy motýľov ( napr. Jasoň červenooký), a tak sa na chvíľu zastavte a pozrite si, ako vo filme, pulzujúci život na horskej lúke. \r\nZ hornej lúky už je to len krôčik ku krásnemu Strážovu (1213 m.n.m.) keď si sadnete na vrchole na jeden zo skalných výbežkov, otvorí sa vám úžasná panoráma strážovských vrchov, hlbočiny strážovských kotlín a pri dobrej viditeľnosti aj labyrint Súľovských skál na severe. Ani sa vám nebude chcieť ísť naspäť, ale treba sa pobrať ďalej. A tak sa vrátite do sedla, odkiaľ už po zelenej TZ budete pokračovať na Čierny vrch ( 1068 m.n.m.), Vráblovú ( 814 m.n.m.) až po sedlo Samostrel, kde by ste mali byť asi za 1,5 hodiny. Je tam celkom pekné odpočívadlo, kde sa môžete aj skryť pred dažďom, alebo sa posilniť na záverečnú časť našej túry. Do Čičmian už budete len mierne klesať po žltej TZ a celú obec si potom môžete prezrieť od začiatku až do konca. Tak ako každého návštevníka vás upúta typická ornamentálna výzdoba dreveníc. Jednoduché motívy vychádzali z tunajších výšiviek, ktoré si môžete pozrieť aj v národopisnej expozícii miestneho múzea.\r\n	Verím, že táto túra v srdci strážovských vrchov na vás urobí veľký dojem a že sa sem budete vždy radi vracať.\r\n', 0, '2009-01-20 22:00:01', 'Štrkáč', 1, '', 0, 0),
(30, 31, 'Chočské vrchy 1 - Prosiecka a Kvačianska dolina', 'Prosiek – Svorad – Prosečné – Čierna hora – Oblazy – ráztocký vodopád – Kvačany ( .... )\r\n\r\n	Túlanie po chočských vrchoch začneme v ich najvýchodnejšej časti, v Prosieckej a Kvačianskej doline.\r\n', 'Dopraviť sa do tejto oblasti je pre Kysučanov trochu zložitejšie, preto odporúčam na túto túru sa vypraviť autom ak je táto možnosť (cez Bešeňovú) a dostať sa až na parkovisko na začiatku Prosieckej doliny. Do doliny vedie pekný chodník po modrej TZ, ktorý vás za necelú hodinku prevedie najnavštevovanejšou dolinou Chočských vrchov, pomedzi masívmi Lomného a Prosečného. Môžete tu obdivovať rôzne skalné výtvory, skalné hrnce a jaskyne, ktoré sa v tejto národnej prírodnej rezervácii v hojnom počte nachádzajú. Najzaujímavejšia a asi aj najkrajšia je tiesňava v hornej, záverečnej časti doliny, ktorú s pomocou reťazí a rebríkov hravo zdoláte. Určite vás prekvapí, tak ako aj mňa, že v celej doline nenájdete takmer ani kvapku vody, pokiaľ tu, samozrejme, nebudete na jar alebo za výdatného dažďa. Za všetko môže vápenec, ktorý všetku vodu pohltí a skrýva pred zrakmi návštevníkov vo svojich útrobách. A tak si môžete pochodiť po potoku a ani si nenamočíte topánky! Vodopád samozrejme uvidíte, ale bez vody a to už nie je to pravé orechové. Neostáva vám nič iné a na skalnej stene si ho môžete len predstaviť. \r\n	Keď sa dostanete do sedla Svorad, musíte sa rozhodnúť, či ďalej pokračovať po modrej TZ, ktorá je krásnou prechádzkou, alebo zvoliť obtiažnejšiu trasu po zelenej TZ, s výstupom na Prosečné (1372 m.n.m).  Ak sa rozhodnete pre zelenú, pokoríte tak jeden zo známych vrcholov Chočských vrchov, Prosečné . No nečakajte prechádzku ružovým sadom. Dostať sa do tejto nadmorskej výšky dá celkom zabrať. Ale turistika nie je len o tom prejsť sa po rovinke, urobiť zopár fotiek a sadnúť do auta. Človek musí aj čosi obetovať a potom má väčšiu radosť, koľko toho zvládol, že prekonal lenivosť a otestoval svoj fyzický potenciál.\r\nNež sa ale dostanete na samotný vrchol, nezabudnite v sedle odbočiť doľava, lebo značenie je tu trochu zmätené. Z Prosečného vás potom čaká pekný výhľad na Roháče, ale tiež na Liptovskú Maru, ktorá bola tak blízko, že by som do nej hneď skočil. Tak sme sa rozhliadli a teraz nás čaká pekne strmý, zle značený zostup úzkym chodníčkom a tak si dajte pozor, aby ste nezablúdili, ako sa to podarilo mne. Vraj odbočka je pri padnutom strome, ktorý ja som obišiel zľava, no vy vyskúšajte cestičku vpravo. Ale možno dovtedy už bude chodníček lepšie upravený. Asi po 40 minútach sa dostanete na lúku s jediným orientačným bodom a tým je malá ovčiareň, kde je aj zelená TZ, ktorá sa neskoršie, asi za hodinu, napojí za dedinou Veľké Borové na modrú TZ a tým sa už budete blížiť k doline Kvačianskej. Ale pozor, pokiaľ už uvidíte dedinu Veľké Borové, nezabočte k nej na asfaltovú cestu, ale choďte ďalej popod les smerom nadol po prašnej cestičke. Za odmenu, že ste sa vybrali touto cestičkou značenou namodro, vás na začiatku čaká miesto zvané Oblazy, čo je veľmi pekný skanzen s dvomi vodnými mlynmi, Gejdošovskou, Brunčikovskou a Starou pílou, ale takisto upravená rieka s mostom, a upravené okolie, kde sa pasú kozičky. Zrazu sa tak ocitnete v dávnej histórii. Ja som si pripadal, akoby som sa dostal do jakubiskovej tisícročnej včely. Ozajstná paráda!!!\r\nCelú dolinu tvoria skalné vápencové steny v miestach až 100 m vysoké. Nad horným mlynom si nezabudnite odskočiť na Ráztocký vodopád a tiež sa nezabudnite napojiť na červenú TZ, ktorá vás bezpečne prevedie celou dolinou, ktorá je celá zalesnená a tak výhľadu po okolitých skaliskách si príliš neužijete. Ak sa nebojíte riskovať, môžete po úzkych chodníčkoch nazrieť na okraj priepasti. Po hodinke chôdze po cyklotrase sa dostanete na parkovisko nad Kvačany, odkiaľ sa po žltej TZ asi za 1,5 hod. dostanete späť ku Prosieckej doline. Prajem vám na tejto túre viacej vody, aby ste mali veľa pôsobivých zážitkov obidvoch dolín.\r\n', 0, '2009-01-19 23:00:01', 'Štrkáč', 1, '', 0, 0),
(31, 31, 'Lučanská Malá Fatra 1 - Kľak', 'Fačkov – Suchá dolina – Malý Kľak – Kľak – Ostrá skala – Vríčanské sedlo – Žiar – Rajecká Lesná \r\n\r\nLučanská malá Fatra je tak trochu v tieni Fatry Krivánskej, aspoň čo sa týka turistického ruchu. Cez týždeň tu niekedy, veru, živého nestretnete. Zrejme je to tým, že toto pohorie je viac zalesnené, príroda viac divokejšia a z hrebeňoviek nie sú až také pekné výhľady, ako je tomu na Krivánskej Fatre. Je tu však niekoľko veľmi zaujímavých a veľmi pekných vrchov, medzi ktoré určite patrí Kľak. Podľa odborníkov dokonca patrí k tým najkrajším na Slovensku. Tak sa poďme naň pozrieť!\r\n', 'Najprv sa ale musíme dostať do blízkosti tohto krásavca a to najlepšie autobusom zo Žiliny, smer Fačkov. Čím prv, tým lepšie, a tak spoj o 6:30 hod. je ideálny. Od zastávky Fačkov – Jednota sa hneď prvou odbočkou vľavo pustite po modrej TZ do krásnej prírody Suchej doliny. Širokou poľnou cestou okolo potoka sa asi po 45 min. dostanete na koniec Suchej doliny (653 m.n.m.), kde vás smerovník vyženie vpravo do svahu, do vysokej trávy a úzkym chodníkom sa potom stočte do protiľahlého zmiešaného lesa. Tam sa bude šmykľavý chodník točiť do serpentíny a už vás po 40 min. dovedie na širokú, kamenitú lesnú cestu, ktorej koniec je v nedohľadne. Ale nezúfajte, bude ešte horšie!  chodník je síce pohodlný, ale 1,5 hodiny tiahleho stúpania dá celkom zabrať. Keď už konečne budete v sedle malého Kľaku, začína vám tá najpríjemnejšia časť vašej túry, s peknými výhľadmi nielen z Malého Kľaku (1204 m.n.m.), na  ktorý si môžete odskočiť, ale predovšetkým z Kľaku (1352 m.n.m.), ktorý je naším cieľom. Určite vás prekvapí, že na tomto skalnatom vrchole by kľudne mohlo byť aj futbalové ihrisko. Kľak je, totiž, z veľkej časti zatrávnený a výhľad z neho je naozaj parádny. Môžete si tu urobiť predstavu, čo vás ešte čaká a neminie, lebo Rajeckú Lesnú, Fačkov a aj Rajec máte ako na dlani. Môžete si aj urobiť masáž nôh, lebo vás čaká už len klesanie a nekonečné brzdenie. \r\nA tak sa dajme do zostupu, tentoraz po červenej TZ. Najprv to bude vyzerať celkom pohodlne, takmer až k Ostrej skale (1220m.n.m.), ale potom už vás bude čakať len chodník lesom s veľmi nepríjemnými úsekmi, kde lístie a bahno preverí vaše brzdiace schopnosti až po Vríčanské sedlo (950m.n.m.). jedinou vzpruhou na tejto ceste zarúbanej je studnička pod sedlom, ku ktorej by ste sa asi po hodine mali dostať a kde sa môžete osviežiť lahodnou fatranskou vodou. Ale pozor, šmykľavé klesanie na tomto chodníku ešte neskončilo, no keď sa budete držať žltej TZ, prekročíte asi po hodinke bujarú bystrinku a už budete v rajecko-lesnej doline, v blízkosti chatovej osady Žiar (580m.n.m.).\r\nPotom už vás čaká len záverečný, asi 1,5 hodinový úsek po málo frekventovanej ceste, po ktorej sa dostanete (po modrej TZ) do Rajeckej lesnej. Táto dedina je známa predovšetkým svojim krásnym Betlehemom ( v blízkosti kostola v centre dediny), ktorý chodia navštevovať turisti z mnohých krajín. Nezabudnite si pozrieť toto výnimočné dielo, pretože je to skvost rezbárskeho umenia! Je to naozaj dobrý relax po namáhavej túre. \r\n', 0, '2009-01-21 23:00:01', 'Štrkáč', 1, '', 0, 0),
(32, 31, 'Lučanská Malá Fatra 2 -  Veľká lúka', 'Zámok Kunerád – Svitačova dolina – Veterné – Veľká lúka – Krížava – Minčol –S.Javorina - S. Rakytie – Strečno (18 km)\r\n\r\n	Lučanská  Malá Fatra ma tentoraz naozaj veľmi milo prekvapila a keď absolvujete celú túto túru, verím, že prekvapí aj vás. Dostať sa k východziemu bodu trasy, ku Kunerádskemu zámku je celkom jednoduché. Zo Žiliny chodí autobusový spoj ( v pracovných dňoch je ideálny spoj o 6:45 hod.), ktorý má konečnú priamo pod zámočkom. Tento veľmi pekný secesný zámok zdobený arkádami, terasami a nárožnými vežami bol pôvodne postavený ako lovecký. Behom SNP slúžil ako základňa štábu 2. partizánskej skupiny M. R. Štefánika a v roku 1944 bol nacistami vypálený. Donedávna slúžil ako liečebný ústav, žiaľ, teraz je opustený a chátra. \r\n', 'Od zámku vedie niekoľko turistických trás. Vy sa ale držte nášho plánu a vyrazte po žltej TZ, ktorá vás prevedie celou Svitačovou dolinou. Najprv to bude po asfaltke, ktorá je aj cyklotrasou, vedúcou popri bujarej bystrinke až k Omegové, kde sa asfaltka zmení na lesnú cestu a bude vás viesť do vyšších sfér. Asi po 1,5 hodine dorazíte k odbočke, kde už začne konečne  riadna turistika, lebo priamočiary strmý chodník hneď preverí, koľko máte nachodené. Asi po hodinke stúpania lesom ucítite prvé nárazy vetra a to bude neklamný znak toho, že sa blížite k Veternému (1442m.n.m.) a buďte si istý, že tam fúkať bude, a to dosť! Tiež sa už bude meniť tvár okolitej krajiny. Bude pribúdať borovníkov, smrekov a bučiny vystriedajú kosodreviny a už budete mať aj krásny výhľad na Malú Fatru a Strážovské vrchy. Na Veternom sa napojíte na magistrálu – červenú TZ, ktorá je pohodovým chodníkom lemovaným kosodrevinami a za 20 minút vás dovedie na najvyšší vrchol Lučanskej Malej Fatry, na Veľkú lúku (1476m.n.m.). je to významná križovatka turistických trás s výborným kruhovitým výhľadom, s nepekným vysielačom a s miestami podmáčanými rašeliniskami. O kúsok ďalej je hneď Krížava (1456m.n.m.), kde z Martinskej holej vedie sedačková lanovka, ktorá je hlavne v zimnom období využívaná pre zimné športy. Celá hrebeňovka je potom úplným rajom, pre turistov, lebo to čo nájdete tu, pod krížom, nenájdete ani v Tatrách, ani v Alpách a dokonca ani v Dolomitoch. Horskú lúku posiatu trsmi horca horského! Je to snáď svetový unikát a úžasná pastva pre oči! Prekrásnej modrastej farby si potom užijete po celej trase až po Minčol (1364m.n.m.),,kde asi po 1,5 hodine dorazíte. V sedle pod Minčolom vás asi prekvapí opustené delo z 2. svetovej vojny, ktoré je tu ponechané ako pamätník. Zvyšky zákopov len dosvedčujú, že tu bola umiestnená delostrelecká batéria a prebiehali tu neľútostné boje v období SNP.\r\n	\r\nPo ďalšej hodinke dorazíte do sedla Javorina (968m.n.m.) a budete pokračovať v klesaní stále pekným chodníkom a stále po červenej TZ až do sedla Rakytie (741m.n.m.). odtiaľ už je to len kúsok, asi hodinka, ku hradu Strečno, ktorý, ak budete mať ešte dosť síl, môžete navštíviť. Zo Strečna je do Žiliny veľmi dobrý autobusový i vlakový spoj a tak myslím, že môžete súhlasiť, keď zvolám: “bolo to krásne, bolo toho dosť!“\r\n', 0, '2009-01-21 22:00:01', 'Štrkáč', 1, '', 0, 0),
(33, 31, 'Kriváňska Malá Fatra 4', 'ŠÚTOVO RIEKA – ŠÚTOVSKÁ DOLINA – ŠÚTOVSKÝ VODOPÁD – CHATA POD CHLEBOM – SNILOVSKÉ SEDLO – CHLEB – HROMOVÉ – CATA POD CHLEBOM – ČIERŤAŽ – HLÁSNA SKALA – ŠÚTOVO – ŠÚTOVO RIEKA – 20 KM\r\n\r\nKeď už sme vás aspoň čiastočne zoznámili s Kriváňskou Malou Fatrou, pozývame vás do centra turistického ruchu tentoraz z druhej strany, od úpätia Veľkej Fatry, zo Šútova.\r\nHlavným cieľom tejto túry je dostať sa k tomu najkrajšiemu, čo Šútovská dolina ukrýva a tým je ŠÚTOVSKÝ VODOPÁD.', 'Dá sa ku nemu dostať pohodlne z parkoviska na konci RIEKY, kde je aj začiatok turistického chodníka. Držte sa modrej TZ, ktorá sa stáča popri Šútovskému potoku a prevedie vás celou dolinou bez veľkého prevýšenia až k vodopádu, kde asi za 1 hod. 20 min. dorazíte. Myslím, že budete veľmi milo prekvapení, keď uvidíte mohutné prúdy vody vyrážajúce z krásnej zelene ako zo 16 m výšky dopadajú na skalnú stenu. Naozaj jedinečný je tento malofatranský vodopád! Myslím, že každému aj naleje nových síl do náročného výstupu, s prevýšením cez 900 m, ktoré treba zvládnuť, aby ste sa dostali do už sľubovaného centra turistického diania, k CHATE POD CHLEBOM ( 1415 m ). Tá bude aj akýmsi orientačným bodom našej túry.\r\nOd turistického smerovníka pred vodopádom sa pustite smelo a bez obáv hore lesom, stále po modrej TZ. Budete sa točiť nad vodopádom a môžete tak pozorovať ako taký krásavec vlastne vzniká. Stúpanie je síce náročné, ale i menej trénovaný to určite zvládnu. Asi po 1 hodine sa už pomaličky začnete vynárať z lesa a budete môcť pozorovať krásu okolitej prírody, ktorá sa začne pred i za vami postupne otvárať. Ako prvý vás privíta Stoh, ktorý ako veľký, zelený kužeľ vyčnieva priamo nad vami. Za ním už nenápadne vykúka najkrajší vrchoľ Malej Fatry, Veľký Rozsutec.\r\nOnedlho prídete k MOJŽÍŠOVÝM  PRAMEŇOM, kde je príjemné miesto na odpočinok a načerpanie nových síl k ďalšiemu už záverečnému stúpaniu, ktoré by vám nemalo trvať viac ako hodinu. Tak sa dostanete na chodník, ktorým sa už po rovinke pohodovo dopravíte k Chate pod Chlebom. Tento chodník, ktorý sa preplieta medzi kosodrevinami pod HROMOVÝM ( 1536 m ) a CHLEBOM ( 1646 m ) prechádza nár. prírodnou rezerváciou v rozlohe 413 ha  a tak tu môžete obdivovať mnohé vápencové skalné útvary a chránené druhy rastlín ako napr. Horec jarný, Šafrán  Heuffelúv apod. Smerom na juhovýcho sa zasa môžete pokochať výhľadmi na Chočské vrchy, na Roháče a na juhu pak na vlniacu sa Veľkú Fatru.\r\nChata je ideálne položená a je tiež skvelým miestom na relax. Je tu aj celkom dobrý výber varených jedál a tak je príjemné si tu na chvíľu poleňošiť. Do SNILOVSKÉHO SEDLA, kde budú smerovať ďalšie vaše kroky, je to asi 35 minút po širokej cestičke, takmer bez prevýšenia. Odtiaľ si môžete odskočiť na VEĽKÝ KRIVÁŇ ( 1709 m ), alebo si urobiť minitúru  cez Chleb a Hromové. Tam sa v sedle napojíte na žltú TZ a vrátite sa späť k chate pod Chlebom.\r\nNa spiatočnú cestu sa vydajte po zelenej TZ, po lyžiarskej zjazdovke smerom na ČIERŤAŽ, aby ste si pozreli ďalšiu Malofatranskú dolinu – Snilovskú. Klesanie nie je až také krkolomné a tak si môžete pri zostupe vychutnávať krásu Veľkej Fatry, ktorá sa týči priamo oproti vám. Bude vám trvať asi 1,5 hod., kým sa dostanete do Šútova, kde u smerovníka nezabudnite odbočiť doľava po žltej TZ. Po asfaltke sa už pohodlne dostanete k parkovisku v Rieke.\r\nVerím, že táto túra splní všetky vaše očakávania, lebo tu nájdete takmer všetko, čo si len náročný turista môže želať.\r\n', 0, '2009-01-22 20:00:01', 'Štrkáč', 1, '', 0, 0),
(34, 31, 'Kriváňska Malá Fatra 5', 'TERCHOVÁ – TIESŇAVY – SOKOLIE – s. PRÍSLOP – BARANIARKY – ŽITNÉ – KRAVIARSKÉ – CHRAPÁKY – SNILOVSKÉ s. – VRÁTNA – ( 14 km )\r\n\r\nTentoraz sme pre vás vybrali veľmi náročnú túru a ten kto ju zvládne, si môže povedať, že už je naozajstným turistom.\r\nZačneme v Terchovej, v rodisku známeho zbojníka Juraja Jánošíka. Táto typická kopaničiarská  obec ležiaca na styku Malej Fatry a Kysuckej vrchoviny je ideálnym východiskom pre milovníkov turistiky.\r\n', 'Na túru sa vydáme z centra Terchovej. Od kostola sa dajte cez hlavnú cestu popri potoku Varínke  naprieč dedinou, smerom k Tiesňavám, kde by ste mali asi za 30 minút doraziť.\r\nModrá TZ vás hneď z cesty vtiahne na zbojnický chodník, ktorý sa stáča hore vpravo do TIESŇAV. Musíme poďakovať Jurajovi a jeho družine, že nám takýto pekný chodník vybudovali a že nám vo výbornom stave vydržal až do dnešných čias. Spočiatku sa určite zadýchate, lebo chodník je dosť strmý, ale keď chcete vidieť známe skalné postavičky a útvary ako sú mních, ťava, sokolia veža atď., neostáva vám nič iné ako šliapať ďalej. Je tu čo obdivovať v tejto chránenej lokalite, vytvorenej vápencovo-dolomitovým hrebeňom chočského príkrovu.\r\nAsi za 1,15 hod. dosť náročného stúpania sa ocitnete na MALÝCH NOCLAHOCH, kde si ale moc nepoležíte. Len sa tu napojíte na žltú TZ a budete aj naďalej stúpať, ale už nie tak atraktívnym chodníkom, až na SOKOLIE ( 1172 m ). Tu je to správne miesto na dlhší odpočinok. Je tu nádherný výhľad na niektoré malofatranské velikány a Veľký Rozsutec z tohto úhľa pohľadu je priam úchvatný.\r\nĎalej vás však čaká dosť dlhá a dosť nezáživná pasáž lesom a tak si výhľadov už moc neužijete. Zato si užijete občasného šmykľavého klesania do sedla Príslop, kde by ste mali po necelej hodine doraziť. V sedle je prvá úniková cesta z tejto túry ( po modrej TZ dole do Starého Dvora ), ale vy to určite nevzdáte a budete s chuťou pokračovať hore po modrej TZ na BARANIARKY ( 1270 m ). Chodník je tu ale nepríjemný, šmykľavý a mazľavý a zabere vám možno viac než hodinu času a možno aj viac síl, než by bolo na takomto prevýšení zdrávo.\r\nKeď už ale budete mať Baraniarky za sebou, budete tak asi v polovici túry. Už sa vám ani nebude chcieť zasa dole a potom hore, ale aby ste sa dostali na ŽITNÉ ( 1265 m ), inak to nepôjde. Počítajte tak s ďalšou hodinou a potom ešte s jednou, keď budete zdolávať KRAVIARSKÉ ( 1361 m ). Ale to už bude naozaj posledný vätší výstup ale už zasa s veľmi pekným výhľadom takmer na celú Fatru. Keď zbehnete z Kraviarského do sedla, tak už máte vyhrané. Síl už bude síce ubúdať, ale čaká vás už len mierne stúpanie na CHRAPÁKY, ktoré by vám nemalo zabrať viac ako 30 minút a záverečnú poľ hodinu po rovinke do SNILOVSKÉHO SEDLA už akosi prežijete. Tam sa v chate u lanovky môžete občerstviť a zmobilizovať posledné zvyšky síl na ozaj už posledný zostup do VRÁTNEJ.\r\nZostup po takejto náročnej túre dá síce zabrať a dá zabrať aj vášmu časovému plánu, lebo musíte počítať s ďalšou hodinou. Zato si už v pohode môžete vychutnať celú trasu, ktorú ste absolvovali od Tiesňav až po Snilovské sedlo.\r\nAko som už spomínal, autobusové spoje z Vrátnej nie sú príliš ideálne, posledný ide v 16.40-S,N a v 16.50-prac.dni. A tak si urobte dobrý časový plán. Čo dodať na záver? Snáď len to, že na tejto túre vás čaká 7 hodín poctivej driny, niekoľko nepríjemných úsekov ale aj veľa krásnych miest s úžasnými výhľadmi. \r\n', 0, '2009-01-22 19:00:01', 'Štrkáč', 1, '', 0, 2),
(35, 31, 'Kriváňska Malá Fatra 6', 'ŠTEFANOVÁ – VRCHPODŽIAR – HORNÉ DIERY – sedlo MEDZIROZSUTCE –\r\nSedlo ZÁKRES – MALÝ ROZSUTEC – PODROZSUTEC – TERCHOVÁ  BIELY POTOK – 10 KM\r\n\r\nTo najkrajšie z Kriváňskej M.Fatry sme si pre vás nechali na koniec nášho putovania a to výstupy na Malý a Veľký Rozsutec. \r\nTieto dva vrcholy by sa dali zvládnuť aj naraz, ale keď si ich chcete naozaj vychutnať, je lepšie ísť na každý zvlášť. A tak poďme najprv na menšieho z bratov Rozsutcov!\r\nIdeálnym východzím miestom je turistická dedinka ŠTEFANOVÁ ( 625 m ),kde vás zavezie autobusový spoj zo Žiliny.\r\n', 'Od konečnej zastávky sa dajte na koniec dediny, kde je smerovník, ktorý vám prezradí, ako pokračovať v načatej túre. Vydáte sa po žltej TZ, ktorá vás po ceste, proti prúdu potoka s miernym stúpaním dovedie do sedla VRCHPODŽIAR ( 745 m ). Potom príde jeden nepríjemný zostup po „ namydlených „ kameňoch a tak si dávajte pozor, abyste túru predčasne neukončili a aby ste sa vo zdraví dostali k salašu na PODŽIARI ( 715 m ). Tám sa od ďalšieho smerovníka dozviete, že modrá TZ je tá vaša a že vás onedlho dovedie do HORNÝCH DIER. Kto má rád tiesňavy, rebríky a veľa vody, bude tu vo svojom živle. Nielen bujarých malých kaskád a vodopádov si tu užijete do sýtosti, ale aj množstvo rebríkov a reťazou, ktoré vám budú pomáhať prejsť túto náročnú pasáž suchou nohou. Za 1,5 hodiny by ste mali túto úvodnú časť zvládnuť a dostať sa do sedla MEDZIROZSUTCE ( 1200 m ). Tam je to správne miesto na odpočinok s veľmi pekným výhľadom na Malý Rozsutec. Ako sami uvidíte, až tak malý zasa nie je. Keď si oddýchnete, dajte sa potom po červenej TZ do malého sedla ZÁKRES ( 1225 m ), odkiaľ už môžete sledovať zeleno značený chodník, ktorý vás asi o 10 minút dovedie k úpätiu MALÉHO ROZSUTCA ( 1344 m ). Záverečný, takmer priamočarý výstup sa dá zvládnuť veľmi rýchlo ( asi 25 min. ). Z počiatku budete stúpať po nenáročných sutinových prahoch. Neskoršie to bude trocha náročnejšie, ale s pomocou reťazu a svojich vlastných síl to istotne zvládnete a budete si tak môcť vychutnávať krásnych výhľadov, hlavne na V. Rozsutec. Z vrcholu je perfektný kruhový rozhľad na okolité vrchy a doliny. Samotný vrchol vás možno trocha prekvapí mohutnosťou skalných stien, ktoré ukrývajú množstvo flóry, typickej pre túto oblasť.\r\nHoršie to ale bude so zostupom, ktorý je spočiatku veľmi prudký a dosť nepríjemný!\r\nNajprv ale musíte nájsť chodník so zelenou TZ a než sa nazdáte už sa budete šúchať po nepríjemných sutinách. V žľabe pod vrcholom budete na brzdenie potrebovať všetky končatiny a možno aj zadnú časť tela. Keď sa už dostanete do ihličnatého lesa, ktorý sa neskôr zmení na bukový, máte vyhrané. Klesanie je tu o poznanie príjemnejšie a tak sa už bez brzdenia dostanete do chatovej osady PODROZSUTEC (800 m ). Za osadou sa stočíte doľava cez lúky, polia a ihličnatý les až sa zrazu vynoríte u hotela Diery v TERCHOVEJ – BIELY POTOK ( 575 m ).\r\nAsi 400 m nižšie, u hlavnej cesty, je autobusová zastávka. Keď budete mať šťastie a trocha trpezlivosti, možno že sa autobusu aj dočkáte. Ak nie, neostáva vám nič iné ako zmobilizovať zvyšok síl a dôjsť do Terchovej po svojich. Odtiaľ je spojenie s okolitým svetom predsa lepšie. \r\n', 0, '2009-01-22 18:00:01', 'Štrkáč', 1, '', 0, 2),
(36, 31, 'Stredoveké hrady a zrúcaniny 1 - Lietava', 'LIETAVSKÁ LÚČKA- LIETAVA MAJER- HRAD LIETAVA- LIETAVSKÁ SVINNÁ- SKALKY- RAJECKÉ TEPLICE – 9 KM\r\n\r\nTých, ktorí majú radi históriu, sme sa rozhodli pozvať do dávnych čias kráľov, rytierov a grófov, do miest, kde sa pred mnohými stáročiami vypínali mohutné hrady a dodnes sa zachovali ich zrúcaniny.\r\n', 'A tak poďte s nami do rozprávky a po stredovekých stezkách navštívte hrad Lietava!\r\nTúto veľmi peknú túru, pre celú rodinu, začneme v Lietavskej Lúčke. Zo Žiliny je lepšie použiť autobusový spoj( 8. 20 atď.) smerom na Rajec, lebo vlakový spoj je len zriedkavý.\r\nV L.Lúčke, hneď u zastávky autobusu je rozdeľovník trias s výraznou modrou TZ, ktorá vás o chvíľu zavedie do krásnej, priam rozprávkovej krajiny pod hradom LIETAVA. Málo kedy sa podarí, že po celej trase k hradu môžete sledovať celú Kysuckú vrchovinu, Kriváňskú i Lučanskú Malú Fatru a v pozadí sa vlniace Strážovské vrchy. Jedinečné!\r\nAsi za 1 hod. 30 minút od zastávky už budete stáť pred zrúcaninou stredovekého hradu, ktorý svojou rozlohou bol druhým najvetším na Slovensku a svojou polohou určite patrí k tým najkrajším. Bol založený v 13. storočí ako majetok Matúše Čáka, v 14. storočí už bol hradom kráľovským. V súčasnosti sú dochované vysoké múry hradných palácov s rôznymi architektonickými detailami, baštami a vežami. \r\nJe odtiaľ úžasný výhľad, ale treba si v niektorých miestach dávať pozor na každý krok, lebo pod niektorými chodníčky už je len hlboká priepasť. Keď sa tohto historického skvostu nabažíte, zostúpte potom po zelenej TZ strmším chodníkom do LIETAVSKEJ SVINNEJ , kde si môžete doplniť zásoby, aby ste zvládli asi hodinový, celkom náročný výstup na SKALKY(778m). Aj na Skalkách si budete pripadať ako v rozprávke, lebo chodník sa kľukatí nad, pod i medzi mohutnými skaliskami , slujami a roklinami, kde by mohol pospávať nejaký zabudnutý šarkan.\r\nZo Skaliek vedie niekoľko dobre značených chodníkov do kúpeľného mestečka RAJECKÉ TEPLICE a tak záleží na vás, ktorý si vyberiete. A tak za necelú hodinku už môžete odpočívať u jazierka v centre mestečka a možno že si práve tu budete pripadať akoby ste sa práve vrátili z dôb dávno minulých.\r\n', 0, '2009-01-18 23:00:01', 'Štrkáč', 1, '', 0, 0),
(37, 31, 'Stredoveké hrady a zrúcaniny 2 - Strečno', 'ZAST. STREČNO – STARÝ HRAD – HRAD STREČNO – 7KM\r\n Ako ďalšiu túru za Povážskymi historickými pamiatkami som vybral zo Severného Slovenska hrad najznámejší, hrad Strečno.\r\nMálo kto vie, že hrady sú vlastne dva a tak si ich poďme popozerať.\r\n', 'Do vlakovej zastávky Strečno sa dopravíte veľmi ľahko zo Žiliny osobným vlakom, ktorý tam ide asi 10 minút. Od zastávky hneď prejdite cez koľaje  a pokračujte po prašnej ceste pod skaliskami až k červenej TZ, na ktorú po chvíli narazíte a ktorej sa budete držať tam aj späť.\r\nZa 45 minút bez veľkého zadýchania už budete medzi ruinami STARÉHO HRADU, kedysi nazývaného Varín, ktorého zvyšky sa týčia na Fatranskom bradle, na pravom brehu Váhu.\r\nHrad bol v 13. storočí postavený z dôvodu ochrany starej obchodnej stezky, v blízkosti brodu cez rieku.\r\nUrčite si prejdite celý hrad, ale opatrne, pokiaľ netúžite si zaplávať v chladných vodách Váhu.\r\nZ útrob hradných stien je prekrásny výhľad na mohutný Váh, ktorý sa stáča popod hrebene Malej Fatry. Keď budete mať šťastie, možno že uvidíte aj plte s turistami, ktoré sa hojdajú na trblietavej hladine.\r\nKu HRADU STREČNO je najlepšie vrátiť sa späť po červenej TZ, ale potom odporúčam odbočiť poľnou cestou vľavo okolo Váhu, aby ste si pohľadu na hrad, ktorý vyzerá na bradle ako orlie hniezdo, dostatočne vychutnali. Náhliť sa príliš nemusíte, určite ešte stihnete prevozníka, ktorý vás spoľahlivo prevezie na Kompe cez Váh len za 5 SK ( lacnejšie ako u Chárona na Stixe ). Z prístaviska už je to na hrad asi 15 minút, pokiaľ sa však nezastavíte v peknej krčmičke v podhradí.\r\nHrad Strečno bol postavený v polovici 14. storočí na ochranu mýta vyberaného pri prechodu cez Váh. Je to výborné výhľadové miesto, predovšetkým z dominantnej veže.\r\nKeď už bude čas na návrat, môžete opäť využiť Kompu, alebo neďaleký most, ktorý spojuje dedinky Strečno a Nezbudskú Lúčku.\r\nVlakové spojenie so Žilinou je dosť dobré ( 14.50, 16.10 atď.) a tak vám prajem šťastný návrat z ďalšieho výletu do historie.\r\n', 0, '2009-01-18 22:00:01', 'Štrkáč', 1, '', 0, 0);
