(38, 31, 'Kriváňska Malá Fatra 3 - Stoh', 'SNILOVSKÉ SEDLO – CHLEB – STENY – POLUDŇOVÝ GRÚŇ – STOH – POLUDŇOVÝ GRÚŇ – CHATA NA GRÚNI – VRÁTNÁ – 13 KM\r\n\r\nAk sa vám treking po Malej Fatre zapáčil, poďte s nami na Stoh!\r\nTento hrdo stýčený vrchol vás svojím výzorom upúta už v SNILOVSKOM SEDLE, ak sa na chvíľu zastavíte na vyhliadke u lanovky. Priam človeka láka, aby sa po tejto sviežo zelenej mohyle poprechádzal.\r\n', 'Aby ste sa ku nemu dostali, musíte sa napojiť na nám už dobre známu magistrálu, tentoraz za lanovkou vľavo, smerom na CHLEB (1646 m). Ďalej vás červená TZ povedie chodníkom lemovaným kosodrevinami, miestami dosť úzkym, ale bezpečným a asi po hodine sa budete stáčať cez Hromové, Stenky a STENY(1480 m) až na POLUDŇOVÝ  GRÚŇ (1460 m).\r\nCelá tato trasa, tak ako všetky hrebeňovky, je naozaj veľmi pekná, s perfektným výhľadom do dolín NP Malej Fatry. Ani sa na tejto prechádzke nezadýchate a tak si v pohodovom tempe môžete vychutnávať pohyb na čerstvom vzduchu. \r\nKeď sa asi po dvoch hodinách ocitnete v SEDLE POD STOHOM (1230 m), myslím že vás humor prejde. STOH (1607 m) tvorí akýsi pilier na konci hrebeňovky a možno že veľké prevýšenie niektorých z vás od výstupu odradí. Keď sa ale budete držať hesla, že odvážnemu šťastie praje, tak sa dielo podarí!\r\nMožno že niektorým z vás bude výstup na túto „ doposiaľ neaktívnu sopku „ bude robiť problemy, ale nevzdávajte sa a treba aj štvornožky sa na vrchol vyškriabte. Stojí za to, dať si tu námahu! Stoh vám za odmenu poskytne úchvatný výhľad na všetky svetové strany, predovšetkým ale na ojedinelý skalný masív s Veľkým a Malým Rozsutcom, na ktorých sa na budúce tiež vyberieme.\r\nKeď si Stohu užijete do sýtosti, bude čas na návrat. Najrozumnejšie je zostúpiť späť na Poludňový Grúň, odkiaľ sa po žltej TZ dostanete dosť strmým chodníkom k CHATE NA GRÚNI (989 m), kde môžete stráviť zaslúžený odpočinok. Do Vrátnej je to od chaty asi 50 minút voľným tempom a tak je treba si záver túry dobre naplánovať, aby ste boli včas u zastávky, lebo v letných mesiacoch bývajú autobusy dosť nabité. Neškodilo by posilniť tieto turistické spoje, ktoré sú tak často preplnené!\r\n', 22, '2009-01-22 21:00:01', 'Štrkáč', 1, , 0, 5);
INSERT INTO `clanok` (`clanok_id`, `main_section_id`, `nazov`, `short_text`, `big_text`, `section_id`, `datetime`, `user`, `comments`, `image`, `home`, `counter`) VALUES
(39, 31, 'Kriváňska Malá Fatra 7 - Veľký Rozsutec', '\r\nŠTEFANOVÁ – VRCHPODŽIAR – PODŽIAR  - s.MEDZIROZSUTCE – VELKÝ ROZSUTEC – s.MEDZIHOLIE – ŠLAHORKA – ŠTEFANOVÁ – 9 KM\r\n\r\nTak Malý Rozsutec už máme za sebou a teraz už nás čaká len výstup na jeden z najkrajších slovenských vrcholov, na Veľký Rozsutec.\r\nPrvú časť trasy absolvujete podobne ako tomu bolo v predchádzajúcom príspevku, takže už len skrátene. ', 'Zo Štefanovej cez Vrchpodžiar ( 745 m ) a Podžiar ( 715 m ) po žltej TZ, potom cez Horné diery po modrej TZ až do sedla Medzirozsutce ( 1200 m ). Tam sa zo sedla ale vydáte doprava po červenej TZ. Najprv budete stúpať širokým lesným chodníkom a potom už opatrnejšie po skalných prahoch, kde je trocha horšia orientácia a tak sa v množstve cestičiek držte tej správnej. Keď sa vám nič zlé nepritrafí, tak asi za 1,5 hod. by ste mali byť na samom vrchu najkrajšej hory celej Malej Fatry, na VELKOM ROZSUTCI ( 1610 m ).\r\nTento vrchol je si treba vychutnať a tomu nám napomáha jeho rozložitosť a niekoľko chodníkov, ktoré spájajú jednotlivé skalné útvary. Najkrajšie je tu určite na jeseň, keď celé okolie hrá všetkými farbami, doliny sú naplnené „ mliekom „ z hmly a je prekrásny výhľad až na Roháče. To sú naozaj nezabudnuteľné zážitky!\r\nKeď sa dostatočne nasýtite tohto rozoklaného vápencového masívu, ktorého územie bolo vyhlásené za nár. prírodnú rezerváciu, budete zostupovať do sedla MEDZIHOLIE ( 1185 m ). Samotný zostup nie je tak náročný ako napr. z M. Rozsutca, ale opatrnosti na strmých sutinových srázoch nikdy nie je nazvyš. Voľným tempom to do hodiny musíte zvládnuť.\r\nSedlo Medziholie je aj ideálnym miestom na odpočinok. Vedie odtiaľ zeleno značený chodník, z ktorého v prvej časti môžete obdivovať skalné rozsadliny V. Rozsutca, než vás pohltí temný, smrekový les. Týmto lesom aj naďalej budete klesať na ŠLAHORKU ( 950 m ) a potom až do ŠTEFANOVEJ k zastávke autobusu, čo by vám nemalo trvať viac ako 1, 15 hod.\r\nKrásnych zážitkoch na Kriváňskej Malej Fatre budete mať pri jej návšteve určite veľa. Myslím, že výstup na nenapodobiteľný V. Rozsutec bude jedným z tých na ktoré sa spomína celý život.\r\n\r\n', 0, '2009-01-22 15:00:01', 'Štrkáč', 1, '', 0, 0);
